(59, '2016-06-02 00:00:00', 'Nguyễn Văn Tài, Đỗ Duy Hồng', 'ff', 'Đối tượng KT: + HKD Trúc Danh, CCS: A, Đ/C: ttt\r\nNoi dung: 1,212015 quy định chế độ hoá đơn, chứng từ đối với hàng hoá nhập khẩu lưu thông trên thị trường, toàn bộ số hàng hoá mỹ phẩm của bà Loan hiện Đội QLTT số 5 đang tạm giữ là hàng nhập lậu. \r\nCăn cứ hồ sơ vụ việc đã được xác lập, bà Trương Thị Ánh Loan - thường trú 253 Nguyễn Huệ, TP Quy Nhơn, tỉnh Bình Định, kinh doanh hàng hoá mỹ phẩm dưới hình thức buôn chuyến,\r\n', '8h - 11h', 'Căn cứ Thông tư liên tịch số 64/2015/TTLT-BTC-BCT-BCA-BQP ngày 08/5/2015 quy định chế độ hoá đơn, chứng từ đối với hàng hoá nhập khẩu lưu thông trên thị trường, toàn bộ số hàng hoá mỹ phẩm của bà Loan hiện Đội QLTT số 5 đang tạm giữ là hàng nhập lậu. \r\nCăn cứ hồ sơ vụ việc đã được xác lập, bà Trương Thị Ánh Loan - thường trú 253 Nguyễn Huệ, TP Quy Nhơn, tỉnh Bình Định, kinh doanh hàng hoá mỹ phẩm dưới hình thức buôn chuyến, không thường xuyên (thuộc đối tượng không phải đăng ký kinh doanh qui định tại Khoản 2 Điều 66 Nghị định 78/2015/NĐ-CP ngày 14/9/2015 về đăng ký doanh nghiệp) đã có hành vi vi phạm: Kinh doanh mỹ phẩm nhập lậu.\r\nTổ kiểm tra tiến hành lập biên bản vi phạm hành chính đối với hành vi vi phạm nêu trên để xử lý theo quy định của pháp luật.\r\n', 'Căn cứ Thông tư liên tịch số 64/2015/TTLT-BTC-BCT-BCA-BQP ngày 08/5/2015 quy định chế độ hoá đơn, chứng từ đối với hàng hoá nhập khẩu lưu thông trên thị trường, toàn bộ số hàng hoá mỹ phẩm của bà Loan hiện Đội QLTT số 5 đang tạm giữ là hàng nhập lậu. \r\nCăn cứ hồ sơ vụ việc đã được xác lập, bà Trương Thị Ánh Loan - thường trú 253 Nguyễn Huệ, TP Quy Nhơn, tỉnh Bình Định, kinh doanh hàng hoá mỹ phẩm dưới hình thức buôn chuyến, không thường xuyên (thuộc đối tượng không phải đăng ký kinh doanh qui định tại Khoản 2 Điều 66 Nghị định 78/2015/NĐ-CP ngày 14/9/2015 về đăng ký doanh nghiệp) đã có hành vi vi phạm: Kinh doanh mỹ phẩm nhập lậu.\r\nTổ kiểm tra tiến hành lập biên bản vi phạm hành chính đối với hành v