(68, '2015-12-29 00:00:00', 'Nguyễn Văn Danh; Nguyễn Văn Ngọc', 'Tổ trưởng; Phó Đội trưởng', '1- Giấy chứng nhận đăng ký kinh doanh\r\n2- Hàng hoá đang kinh doanh, hoá đơn chứng từ liên quan đến hàng hoá.', '29-12-2015', '- Tại thời điểm kiểm tra, chủ cơ cở xuất trình giấy chứng nhận đăng ký kinh doanh hộ kinh doanh cá thể số 35A8011888 đăng ký lần đầu ngày 26/9/2013 do phòng Tài Chính - Kế Hoạch UBND thành phố Quy Nhơn cấp. Cơ sở kinh doanh Shop Đồ Rê Mí do bà Huỳnh Thị Minh Trâm làm chủ cơ sở đang kinh doanh mặt hàng quần áo trẻ em các loại tại địa điểm: 103 Vũ bão, phường Ngô Mây, thành phố Quy nhơn, tỉnh Bình Định, hoạt động kinh doanh không đúng địa điểm ghi trong giấy chứng nhận đăng ký kinh doanh là 99 Vũ Bão, phường Ngô Mây, thành phố Quy Nhơn, tỉnh Bình Định.\r\n-Tại thời điểm kiểm tra, cơ sở kinh doanh Shop Đồ Rê Mí da bà Huỳnh Thị Minh Trâm làm chủ cơ sở đang kinh doanh mặt hàng quần áo trẻ em các loại, do nước ngoài sản xuất, không có hoá đơn chứng từ kèm theo, gồm: Chân váy dệt kim hiệu AMTN, made in China, số lượng 10 chiếc, đầm đính kim sa hiệu PINK & VIOLET, made in China, số lượng 05 chiếc; đầm đính kim sa hiệu PLACE, made in China, số lượng 04 chiếc; quần jean dây đeo hiệu HANDSOME, made in China, số lượng 08 chiếc; áo full house hiệu H & M, made in cambodia, số lượng 05 chiếc, bộ quần áo trẻ em hiệu carter\'s, made in cambodia, số lượng 14 bộ; áo hiệu Baby Gap, made in Cambodia, số lượng 11 chiếc; chân váy hiệu Zara Girls, made in Cambodia, số lượng 05 chiếc; áo sơ mi hiệu Guess, made in China, số lượng 06 chiếc.\r\n- Tổng giá trị hàng hoá: 11.370.000 đồng tính theo giá niêm yết tại cơ sở ( niêm yết giá trực tiếp trên từng hàng hoá).', '1- Hành vi kinh doanh không đúng địa điểm kinh doanh ghi trong giấy chứng nhận đăng ký kinh doanh: phạt tiền 3.000.000 đồng theo quy định tại khoản 1 điều 6 Nghị định 185/2013/NĐ-CP ngày 15/111/2013 của Chính phủ.\r\n2- Hành vi kinh doanh hàng hoá nhập lậu: phạt tiền 4.000.000 triệu đồngtheo quy định tại điểm đ, khoản 1, điều 17 Nghị định số 185/2013/NĐ-CP ngày 15/11/2013 của Chính Phủ; tịch thu tang vật vi phạm theo quy định tại điểm a khoản 4 điều 17 nghị định số 185/2013/NĐ-CP ngày 15/11/2013 của Chính Phủ, gồm: Chân váy dệt kim hiệu AMTN, made in China, số lượng 10 chiếc, đầm đính kim sa hiệu PINK & VIOLET, made in China, số lượng 05 chiếc; đầm đính kim sa hiệu PLACE, made in China, số lượng 04 chiếc; quần jean dây đeo hiệu HANDSOME, made in China, số lượng 08 chiếc; áo full house hiệu H & M, made in cambodia, số lượng 05 chiếc, bộ quần áo trẻ em hiệu carter\'s, made in cambodia, số lượng 14 bộ; áo hiệu Baby Gap, made in Cambodia, số lượng 11 chiếc; chân váy hiệu Zara Girls, made in Cambodia, số lượng 05 chiếc; áo sơ mi hiệu Guess, made in China, số lượng 06 chiếc.', NULL, '2016-06-14 16:04:12', 28, '2016-06-14 16:04:12', 28, NULL, NULL, 0, NULL, NULL);
