(69, '2016-04-13 00:00:00', 'Nguyễn Văn Ngọc, Đinh Minh Tiến ', 'Tổ trưởng, Kiểm soát viên thị trường ', '- Giấy chứng nhận đăng ký kinh doanh\r\n- Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo\r\n- Nhãn hàng hóa\r\n- Niêm yết giá', '13/4/2016', '- Giấy chứng nhận đăng ký kinh doanh hộ kinh doanh cá thể số :35A801319 ngày 20/11/2015\r\n- hàng hóa đang kinh doanh tại cửa hàng gồm:quần áo may sẳn do Việt Nam sản xuất, hàng hóa có hóa đơn chứng từ kèm theo.\r\n- Hàng hóa co nhãn đúng quy định , cửa hàng thực hiện niêm yết giá đúng quy định.\r\n', 'không vi phạm', NULL, '2016-06-15 14:07:23', 28, '2016-06-15 14:07:23', 28, NULL, NULL, 0, NULL, NULL),
(70, '2016-04-12 00:00:00', 'Nguyễn Văn Ngọc, Đinh Minh Tiến ', 'Tổ trưởng, Kiểm soát viên thị trường ', '- Giấy chứng nhận đăng ký kinh doanh \r\n- Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo\r\n- Nhãn hàng hóa \r\n- Niêm yết giá ', '10 giờ đến 11 giờ 30 ngày 12/04/2016', '-Giấy chứng nhận đăng ký kinh doanh hộ kinh doanh cá thể số:35A8011829 ngày 15/8/2013\r\n- hàng hóa đang kinh doanh tại cửa hàng gồm : quần áo may sẳn các loại do Việt Nam sản xuất. hàng hóa có hóa đơn chứng từ kèm theo, hàng hóa có nhãn đúng quy định. Cửa hàng có thực hiện niêm yết giá đúng quy định .', 'không vi phạm', NULL, '2016-06-14 15:58:44', 28, '2016-06-14 15:58:44', 28, NULL, NULL, 0, NULL, NULL),
(71, '2016-04-12 00:00:00', 'Nguyễn Văn Ngọc, Đinh Minh Tiến ', 'Tổ trưởng, Kiểm soát viên thị trường ', '- Giấy chứng nhận đăng ký kinh doanh\r\n- hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo\r\n- Nhãn hàng hóa\r\n- Niêm yết giá', '7 giờ 30 đến 9 giờ 30 ngày 12/04/2016', '- Chủ hộ kinh doanh có xuất trình: Giấy chứng nhận đăng ký hộ kinh doanh số: 35A 800517 do UBND TP.Quy Nhơn cấp ngày 23/10/2008. ( bản chính )\r\n- Hàng hóa đang kinh doanh tại cửa hàng: Pin Panasonic AA, Loa kéo Temeishung; loa vi tính, bộ thu tín hiệu, bàn phím vi tính các loại. hàng hóa coa hóa đơn giá trị gia tăng số: 0002185 ngày 7/12/2015; số: 0004134 ngày 10/9/2014 (liên hai bản chính); Hóa đơn bán hàng số 0013044 ngày 5/6/20415; số: 0079270 ngày 06/4/2016; số: 0013048 ngày 19/6/2015 ( liên 2 bản chính).\r\n- Việc ghi nhãn hàng hóa: Qua kiểm tra tổ kiểm tra phát hiện cửa hàng đang kinh doanh một số mặt hàng điện tử có nhãn bị mờ không đọc được hết các nội dung trên nhãn hàng hóa cụ thể:\r\n1/ Loa kéo Temeishung 297L – BCT số lượng 03 cái giá trị: 6.300.000 đồng.\r\n2/ Loa kéo Temeishung 2305L – BCT số lượng 01 cái giá trị: 2.700.000 đồng.\r\n3/ Loa kéo Temeishung 338 số lượng 02 cái giá trị: 3.000.000 đồng.\r\n4/ Loa kéo Temeishung 107 số lượng 01 cái giá trị: 1.800.000 đồng.\r\n5/ Pin Panasonic AA số lượng 50 hộp giá trị: 7.500.000 đồng.\r\n* Tổng giá trị hàng hóa vi phạm: 21.300.000 động ( tính theo giá niêm yết)\r\n- Các mặt hàng cón lại có nhãn đúng quy định.\r\n- Cửa hàng có thực hiện niêm yết giá hàng hóa đúng quy định bằng hình thức niêm yết trực tiếp trên sản phẩm.\r\n', 'Hình thức xử phạt chính: Phạt tiền 750.000 đồng (Bảy trăm năm mươi nghìn đồng) theo quy định tại Khoản 2 Điều 3 và điểm c Khoản 2 Điều 25 Nghị định số 80/2013/NĐ-CP ngày 19/7/2013 của Chính phủ.\r\nBiện pháp khắc phục hậu quả: Buộc ghi lại nhãn hàng hóa theo đúng quy định .Quy định tại khoản 3 Điều 25 Nghị định số 80/2013/NĐ-CP ngày 19/7/2013 của Chính phủ.\r\n', NULL, '2016-06-14 16:16:17', 28, '2016-06-14 16:16:17', 28, NULL, NULL, 0, NULL, NULL),
(72, '2016-05-13 00:00:00', 'Nguyễn Văn Ngọc; Đinh Minh Tiến', 'Tổ trưởng; Kiểm soát viên', '- Giấy chứng nhận đăng ký kinh doanh;\r\n- Hàng hoá đang kinh doanh và hoá đơn chứng từ kèm theo;\r\n- Việc ghi nhãn hàng hoá;\r\n- Việc niêm yết giá.', '14h-16h, ngày 13 tháng 5 năm 2016', '- Kinh doanh dưới hình thức hộ kinh doanh mua bán mặt hàng quần, áo may sẵn không có giấy chứng nhận đăng ký kinh doanh.\r\n- Hàng hoá đang kinh doanh tại cửa hàng: quần áo may sẵn các loại có hoá đơn bán hàng liên 2 bản chính số: 0009210 ngày 13/5/2016 (có photo kèm theo).\r\n- Việc ghi nhãn hàng hoá: hàng hoá sản xuất ở Việt Nam có nhãn hàng hoá đúng quy định.\r\n- Việc niêm yết giá: cửa hàng có thực hiện niêm yết giá hàng hoá đúng quy định. (niêm yết giá trực tiếp trên sản phẩm)', 'Phạt tiền: 2.500.000 đồng ( Hai triệu năm trăm ngàn đồng ) quy định tại khoản 2 điều 6 Nghị định 185/2013/NĐ-CP ngày 15 tháng 11 năm 2013 của Chính Phủ quy định xử phạt vi phạm hành chính trong hoạt động thương mại, sản xuất, buôn bán hàng giả, hàng cấm và bảo vệ quyền lợi người tiêu dùng được sửa đổi bổ sung tại khoản 7 Điều 1 Nghị định số 124/2015/NĐ-CP ngày 19/11/2015 của Chính Phủ.', NULL, '2016-06-16 14:21:08', 28, '2016-06-16 14:21:08', 28, NULL, NULL, 0, NULL, NULL),
(73, '2016-04-08 00:00:00', 'Phạm Văn Hồng, Phan Thị Hồng Vân', 'Tổ trưởng, Kiểm soát viên thị trường ', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Giấy chứng nhận đủ điều kiện vệ sinh an toàn thực phẩm;\r\n- Hàng hóa đang kinh doanh, hóa đơn chứng từ kèm theo;\r\n- Nhãn hàng hóa;\r\n- Niêm yết giá.\r\n', '16g15-18g ngày 08/04/2016', '- Giấy chứng nhận đăng ký kinh doanh số :00566/HKD ngày 25/04/2015\r\n- Giấy chứng nhận đủ điều kiện vệ sinh an toàn thực phẩm số: 995/2015/ATTP-CNĐK ngày 02/6/2015.\r\n- Hàng hóa đang kinh doanh có hóa đơn chứng từ kèm theo, có Nhãn hàng hóa và Niêm yết giá đúng quy định.\r\n', '- Cơ sở có Giấy chứng nhận đăng ký kinh doanh,có Giấy chứng nhận đủ điều kiện vệ sinh an toàn thực phẩm, Hàng hóa đang kinh doanh có hóa đơn chứng từ kèm theo,  hàng hóa và Niêm yết giá đúng quy định.', NULL, '2016-06-15 09:38:44', 28, '2016-06-15 09:38:44', 28, NULL, NULL, 0, NULL, NULL),
(74, '2016-04-11 00:00:00', 'Phạm Văn Hồng, Phan Thị Hồng Vân', 'Tổ trưởng, Kiểm soát viên thị trường ', '- Giấy chứng nhận đăng ký kinh doanh;\r\n- Hàng hóa đang kinh doanh, hóa đơn chứng từ kèm theo;\r\n- Nhãn hàng hóa;\r\n- Niêm yết giá.\r\n', '14g- 16g30 ngày 11/4/2016', '- Giấy chứng nhận đăng ký kinh doanh số: 4100554552 ngày 19/12/2014\r\n- Hàng hóa đang kinh doanh có hóa đơn chứng từ kèm theo,có  Nhãn hàng hóa đúng quy định\r\n- Công ty có thực hiện niêm yết giá đúng quy định.', '-  Công ty có Giấy chứng nhận đăng ký kinh doanh, Hàng hóa đang kinh doanh có hóa đơn chứng từ kèm theo,có  Nhãn hàng hóa và Niêm yết giá đúng quy định.', NULL, '2016-06-15 10:38:04', 28, '2016-06-15 10:38:04', 28, NULL, NULL, 0, NULL, NULL),
(75, '2016-05-11 00:00:00', 'Phạm Thị Thu Hiền; Phạm Thị Hồng Vân', 'Tổ trưởng; KSVTT', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Giấy chứng nhận đủ diều kiện kinh doanh;\r\n- giấy chứng nhận thực hành tốt nhà thuốc (GPP);\r\n- Giấy khám sức khoẻ;\r\n- Giấy chứng nhận tập huấn kiến thức;\r\n- Hàng hoá đang kinh doanh, hoá đơn chứng từ kèm theo;\r\n- Nhãn hàng hoá;\r\n- Niêm yết giá.', '11h40-13h20,ngày 11 tháng 5 năm 2016', '* Chủ hộ kinh doanh xuất trình:\r\n- Giấy chứng nhận đăng ký kinh doanh hộ kinh doanh cá thể số 4100559663 ngày 05/10/2012 do UBND TP.Quy Nhơn cấp thay đổi lần thứ hai.\r\n- Giấy chứng nhận đủ điều kiện kinh doanh thuốc số 79/YT-GCNKDT do sở y tế cấp ngày 09 tháng 4 năm 2012 có giá trị đến ngày 12 tháng 4 năm 2017.\r\n- Giấy chứng nhận đạt nguyên tắc tiêu chuẩn \"Thực hành tốt nhà thuốc\" (GPP) số 334/GPP do sở y tế cấp ngày 02/10/2014 có giá trị đến hết ngày 02/10/2017; giấy chứng nhận số 51/YT-CNTH do giám đốc sở y tế Bình Định chứng nhận ông Lê Minh Phụng đã tham gia lớp tập huấn \"Thực hành tốt phân phối thuốc-GPP\", \"thực hành nhà thuốc tốt-GPP\" và các văn bản hướng dẫn liên quan ngày 03/10/2010; Giấy chứng nhận số 663/SYT-CNTH ngày 05/4/2015 do giám đốc sở y tế Bình Định cấp cho ông Lê Minh Phụng đã tham gia lớp tập huấn nghị định 176/2013/NĐ-CP ngày 14/11/2013 của Chính Phủ; chứng chỉ hành nghề dược số 77/BĐ-CCHND do giám đốc sở y tế cấp ngày 06/02/2012, có giá trị đến ngày 06/02/2017; sổ khám sức khoẻ định kỳ số 113/FKB ngày 01/7/2015 của ông Lê Minh Phụng; giấy chứng nhận số 318/YT-CNTH do giám đốc sở y tế Bình Định cấp ngày 31/12/2011 cho bà Huỳnh Như Phúc-nhân viến bán hàng và giấy khám sức khoẻ của bà Huỳnh Như Phúc.\r\n- Hàng hoá đang kinh doanh: Thuốc tân dược các loại; hàng hoá có hoá đơn giá trị gia tăng số: 0023595 ngày 21/4/2016; 0031450 ngày 28/4/2016; số:0031121 ngày 28/4/2016; số: 0032987 ngày 29/4/2016; số: 0037770; số: 0037957 ngày 09/5/2016; số: 0004646 ngày 04/5/2016; số: 0328735 ngày 28/4/2016 số: 0355776 ngày 09/5/2016; số: 0186745 ngày 22/04/2016: số: 0186779 ngày 25/4/2016; có mở sổ sách theo quy định.\r\n- Việc ghi nhãn hàng hoá: hàng hoá có nhãn đúng quy định.\r\n- Việc thực hiện niêm yết giá: Nhà thuốc có thực hiện việc niêm yết giá đúng quy định (hình thức niêm yết trực tiếp trên từng sản phẩm).', 'không vi phạm', NULL, '2016-06-16 14:20:09', 28, '2016-06-16 14:20:09', 28, NULL, NULL, 0, NULL, NULL),
(76, '2016-04-08 00:00:00', 'Nguyễn Văn Ngọc, Đinh Minh Tiến ', 'Tổ trưởng, Kiểm soát viên thị trường ', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Hàng hóa đang kinh doanh, hóa đơn chứng từ kèm theo;\r\n- Nhãn hàng hóa;\r\n- Niêm yết giá.\r\n', '15g-16g ngày 08/4/2016', '-Công ty có  Giấy chứng nhận đăng ký kinh doanh số :352043000005 ngày 19/9/2014.\r\n- Hàng hóa đang kinh doanh tại công ty có hóa đơn chứng từ kèm theo, hàng hóa có nhãn đúng quy định. Công ty có thực hiện việc Niêm yết giá đúng quy định.', '-  Công ty có Giấy chứng nhận đăng ký kinh doanh,- Hàng hóa có hóa đơn chứng từ , có Nhãn hàng hóa và Niêm yết giá đúng quy định.\r\n', NULL, '2016-06-15 11:02:39', 28, '2016-06-15 11:02:39', 28, NULL, NULL, 0, NULL, NULL),
(77, '2016-04-13 00:00:00', 'Phạm Thị Thu Hiền, Phan Thị Hồng Vân', 'Tổ trưởng, Kiểm soát viên', 'Giấy chứng nhận đăng ký kinh doanh; hang hóa đang kinh doanh, hóa đơn chứng từ kèm theo; nhãn hang hóa; niêm yết gía.', '8h00 phút ngày 13/4/2016 ', 'Tại thời điểm kiểm tra, có giấy chứng nhận đăng ký kinh doanh; hàng hóa đang kinh doanh gồm: dầu gội, waw, dầu bóng, oxy dưỡng cho tóc, kem dưỡng thể, kem hấp tóc các loại,... do Việt Nam sản xuất, có hóa đơn chứng từ kèm theo.\r\nHàng hóa có nhãn hang hóa đúng quy định.\r\nCơ sở niêm yết giá đúng quy định.', 'Không vi phạm', NULL, '2016-06-15 11:07:54', 28, '2016-06-15 11:07:54', 28, NULL, NULL, 0, NULL, NULL),
(78, '2016-04-06 00:00:00', 'Phạm Thị Thu Hiền, Phan Thị Hồng Vân', 'Tổ trưởng, Kiểm soát viên thị trường ', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Hàng hóa đang kinh doanh, hóa đơn chứng từ kèm theo;\r\n- Nhãn hàng hóa;\r\n- Niêm yết giá.\r\n', '08g-10g ngày 06/4/2016', ' Nội dung kiểm tra như tại biên bản kiểm tra việc chấp hành pháp luật số 003345/BB-KT ngày 06/4/2016 của Đội QLTT số VII. Kết quả như sau:\r\n	- Chủ doanh nghiệp xuất trình Giấy chứng nhận đăng ký doanh nghiệp doanh nghiệp tư nhân số: 4100425035 do Sở kế hoạch và Đầu tư Bình Định cấp đăng ký thay đổi lần thứ 21 ngày 17/8/2015.\r\n	- Hàng hóa đang kinh doanh tại doanh nghiệp gồm: quần, áo thun, caravat, quần lót, áo sơ mi, tất, áo vest, quần vest, áo khoác các loại của Tổng công ty cổ phần may Việt Tiến do Việt Nam. Hàng hóa có hóa đơn giá trị gia tăng ( liên 2, bản chính) số : 0003497 ngày 20/11/2015; 0003493 ngày 20/11/2015; 0005315 ngày 07/12/2015; 0003492 ngày 20/11/2015; 0016183 ngày 23/2/2016\r\n 	- Hàng hóa đang kinh doanh có nhãn hàng hóa đúng theo quy định.\r\n	- Cửa hàng có thực hiện việc niêm yết giá hàng hóa theo đúng quy định  bằng hình thức niêm yết trực tiếp trên hàng hóa.\r\n	Tại thời điểm kiểm tra Tổ kiểm tra không phát hiện vi phạm.\r\n', 'Không vi phạm', NULL, '2016-06-15 14:33:37', 28, '2016-06-15 14:33:37', 28, NULL, NULL, 0, NULL, NULL),
(79, '2016-04-14 00:00:00', 'Nguyễn Văn Ngọc; Đinh Minh Tiến', 'Phó Đội trưởng, Kiểm soát viên', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Giấy chứng nhận đủ điều kiện vệ sinh an toàn thực phẩm;\r\n	- Hàng hóa đang kinh doanh, hóa đơn chứng từ kèm theo;\r\n	- Nhãn hàng hóa;\r\n	- Niêm yết giá.\r\n', '08 giờ 00 ngày 14/4/2016 ', '- Giấy chứng nhận đăng ký kinh doanh hộ kinh doanh cá thể số: 4100587491 do Sở kế hoạch và đầu tư tỉnh Bình Định cấp đăng ký thay đổi lần thứ hai ngày 26/7/2014 ( Bản chính).\r\n	- Giấy chứng nhận đủ điều kiện kinh an toàn thực phẩm số 978/2014/ATTP-CNĐK do Bộ Y Tế cấp ngày 02/10/2014 có giá trị đến 02/10/2017 ( Bản chính).\r\n	- Giấy chứng nhận cơ sở đủ điều kiện kinh an toàn thực phẩm số 939/2015/ATTP-CNĐK do Chi cục an toàn vệ sinh thực phẩm tỉnh Bình Định cấp   ngày 10/2/2015 có giá trị đến 10/2/2018 ( Bản chính).\r\n	- Nhân viên công ty có hồ sơ khám sức khỏe và kiến thức an toàn vệ sinh thực phẩm.\r\n	- Hàng hóa đang sản xuất kinh doanh tại công ty: Nước khoáng, nước ngọt, nước giải khát các loại.\r\n	- Nguyên liệu đầu vào có hóa đơn giá trị gia tăng liên 2 bản chính số: 0000443, 0000805, 0001222, 0000025.\r\n	- Hàng hóa đang kinh doanh có ghi nhãn hàng hóa đúng theo quy định; có công bố hợp quy và đăng ký nhãn hiệu độc quyền. ( có bản pho to kèm theo)\r\n	- Công ty có thực hiện việc niêm yết giá hàng hóa theo đúng quy định bằng hình thức có bảng niêm yết.\r\n', 'Không vi phạm', NULL, '2016-06-15 14:37:49', 28, '2016-06-15 14:37:49', 28, NULL, NULL, 0, NULL, NULL),
(80, '2016-04-14 00:00:00', 'Phạm Thị Thu Hiền; Phạm Thị Hồng Vân', 'Phó Đội trưởng, Kiểm soát viên', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Giấy chứng nhận đủ điều kiện vệ sinh an toàn thực phẩm;\r\n- Giấy phép bán lẻ sản phẩm thuốc lá;\r\n	- Hàng hóa đang kinh doanh, hóa đơn chứng từ kèm theo;\r\n	- Nhãn hàng hóa;\r\n	- Niêm yết giá.\r\n', '08 giờ 00 ngày 14/4/2016 ', '- Cơ sở xuất trình Giấy chứng nhận đăng ký kinh doanh hộ kinh doanh cá thể số: 00361/HKD do UBND thành phố Quy Nhơn cấp đăng ký thay đổi lần thứ nhất ngày 03/11/2003.\r\n	- Cơ sở kinh doanh tạp hóa Cúc Hoa kinh doanh thực phẩm nhỏ lẻ do bà Nguyễn Thị Cúc Hoa làm chủ cơ sở và là người trực tiếp kinh doanh thực phẩm thuộc đối tượng không áp dụng cấp Giấy chứng nhận cơ sở đủ điều kiện an toàn thực phẩm theo quy định tại khoản 3 Điều 2 Thông tư số 58/2014/TT-BCT ngày 22/12/2014 của Bộ Công thương quy định cấp, thu hồi giấy chứng nhận cơ sở đủ điều kiệu an toàn thực phẩm thuộc trách nhiệm quản lý của Bộ Công thương.\r\n	- Giấy phép bán lẻ sản phẩm thuốc lá số; 141/GP-PKT ngày 30/12/2015 do Phòng Kinh tế UBND thành phố Quy Nhơn cấp có giá trị đến hết ngày 29/12/2020.\r\n	- Hàng hóa đang kinh doanh tại cơ sở gồm: sữa tiệt trùng, sữa nước, sữa bột pha sẵn, mì ặn liền, nước ngọt, nước yến, thuốc lá các loại do Việt Nam sản xuất, có hóa đơn GTGT số: 000123 ngày 03/1/2015, 0000449 ngày 12/4/2016, 0009243 ngày 12/4/2016, 0000565 ngày 16/3/2016, 0000455 ngày 12/4/2016.\r\n	- Hàng hóa đang kinh doanh có nhãn hàng hóa đúng theo quy định, còn hạn sử dụng.\r\n	- Cơ sở thực hiện việc niêm yết giá hàng hóa theo đúng quy định  bằng hình thức niêm yết giá bằng bảng mica treo công khai tại cơ sở.\r\n', 'Không vi phạm', NULL, '2016-06-15 14:47:03', 28, '2016-06-15 14:47:03', 28, NULL, NULL, 0, NULL, NULL),
(81, '2016-04-05 00:00:00', 'Phạm Văn Hồng, Đinh Minh Tiến', 'Tổ trưởng, Kiểm soát viên thị trường ', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Hàng hóa đang kinh doanh, hóa đơn chứng từ kèm theo;\r\n- Nhãn hàng hóa;\r\n- Niêm yết giá.\r\n', '14g-16g ngày 05/4/2016', '- Giấy chứng nhận đăng ký kinh doanh số :35A8010528 ngày 22/12/2010\r\n- Hàng hóa đang kinh doanh gồm :Nồi cơm điện, nồi áp suất, siêu sắc thuốc,...hàng hóa có  hóa đơn chứng từ kèm theo;\r\n-Hàng hóa có Nhãn , có tem CR , nhãn năng lượng đúng quy định.\r\n- Cửa hàng thực hiện niêm yết giá đúng quy định.', 'không vi phạm', NULL, '2016-06-15 14:51:06', 28, '2016-06-15 14:51:06', 28, NULL, NULL, 0, NULL, NULL),
