(84, '2016-04-19 00:00:00', 'Nguyễn Văn Ngọc; Đinh Minh Tiến', 'Phó Đội trưởng, Kiểm soát viên', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Giấy chứng nhận đủ điều kiện kinh doanh;\r\n- Giấy chứng nhận thực hành tốt nhà thuốc(GPP);\r\n	- Hàng hóa đang kinh doanh, hóa đơn chứng từ kèm theo;\r\n	- Nhãn hàng hóa;\r\n	- Niêm yết giá.\r\n', '11 giờ 30 ngày 19/4/2016 ', '- Giấy chứng nhận đăng ký kinh doanh hộ kinh doanh cá thể số: 35A8003009 do Sở kế hoạch và đầu tư tỉnh Bình Định cấp đăng ký thay đổi lần thứ hai ngày 25/3/2016 ( Bản chính).\r\n	- Giấy chứng nhận đủ điều kiện kinh doanh thuốc số14/YT-GCNKDT  Sở  y tế tỉnh Bình Định cấp ngày 28/2/2012 có giá trị đến 28/2/2017 ( Bản chính).\r\n	- Giấy chứng nhận cơ sở đạt nguyên tắc, tiêu chuẩn thực hành tốt nhà thuốc số 171/GPP cấp ngày 15/01/2013 có giá trị đến 17/01/2016 ( Bản chính). Nhà thuốc có làm thủ tục cấp lại ngày 18/3/2016.\r\n	- Hàng hóa đang sản xuất kinh doanh tại công ty: Dược phẩm các loại  các loại.\r\n	- Hàng hóa có hóa đơn giá trị gia tăng liên 2 số 0745317; 0124896, 0127691; 0283068 bản chính.\r\n	- Hàng hóa đang kinh doanh có ghi nhãn hàng hóa đúng theo quy định.\r\n	- Công ty có thực hiện việc niêm yết giá hàng hóa theo đúng quy định bằng hình thức có bảng niêm yết và niêm yết trực típ trên sản phẩm.\\\r\n', 'Không vi phạm', NULL, '2016-06-15 15:15:31', 28, '2016-06-15 15:15:31', 28, NULL, NULL, 0, NULL, NULL),
(85, '2016-03-31 00:00:00', 'Phạm Văn Hồng, Đinh Minh Tiến', 'Tổ trưởng, Kiểm soát viên thị trường ', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Giấy chứng nhận đủ điều kiện kinh doanh thuốc;\r\n- Giấy chứng nhận đủ điều kiện an toàn vệ sinh thực phẩm;\r\n- Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo;\r\n- Nhãn hàng hóa;\r\n- Niêm yết giá.\r\n', '12g-13g45 ngày 31/03/2016', '- Giấy chứng nhận đăng ký kinh doanh số :35A8004798 ngày 11/12/2006\r\n- Giấy chứng nhận đủ điều kiện kinh doanh thuốc số :202/YT-GCNKDT ngày 12/11/2012 có giá trị đến ngày 22/11/2017.\r\n- Giấy chứng nhận đạt nguyên tắc , tiêu chuẩn \"thực hành tốt nhà thuốc\" số: 504/GDP ngày 07/12/2015 có giá trị đến ngày 07/12/2018.\r\n- Hàng hóa đang kinh doanh : dược phẩm các loại có hóa đơn gtgt  kèm theo; nhà thuốc không bán thực phẩm chức năng.\r\n- Hàng hóa có Nhãn đúng quy định.\r\n- Nhà thuốc có thực hiện việc Niêm yết giá đúng quy định.\r\n', 'không vi phạm', NULL, '2016-06-15 15:24:09', 28, '2016-06-15 15:24:09', 28, NULL, NULL, 0, NULL, NULL),
(86, '2016-04-19 00:00:00', 'Nguyễn Văn Ngọc; Đinh Minh Tiến', 'Phó Đội trưởng, Kiểm soát viên', '- Giấy chứng nhận đăng ký kinh doanh; \r\n	- Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo;\r\n	- Việc ghi nhãn hàng hóa;\r\n	- Việc niêm yết giá.\r\n', '15 giờ ngày 19/4/2016', '- Công ty xuất trình Giấy chứng nhận đăng ký kinh doanh hộ kinh doanh.\r\n	- Hàng hóa đang kinh doanh tại cơ sở gồm: quạt treo tường, quạt lửng,, bộ đèn điện, dây điện, nồi cơm điện, ban ũi, ấm đun nước siêu tốc có hoá đơn kèm theo\r\n	- Hàng hóa đang kinh doanh có nhãn hàng hóa đúng theo quy định, có dấu hợp quy, có dán nhãn năng lượng.\r\n	- Cơ sở thực hiện việc niêm yết giá hàng hóa theo đúng quy định  bằng hình thức niêm yết trực tiếp trên hàng hóa.\r\n', 'Không vi phạm', NULL, '2016-06-15 15:29:54', 28, '2016-06-15 15:29:54', 28, NULL, NULL, 0, NULL, NULL),
