g hóa theo đúng quy định  bằng hình thức niêm yết giá trực tiếp trên từng sản phẩm.\r\n', 'Không vi phạm', NULL, '2016-06-15 17:03:18', 28, '2016-06-15 17:03:18', 28, NULL, NULL, 0, NULL, NULL),
