(100, '2016-04-25 00:00:00', 'Nguyễn Văn Ngọc; Đinh Minh Tiến, Phạm Văn Hồng', 'Phó Đội trưởng, Kiểm soát viên, Đội trưởng', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Giấy chứng nhận đủ điều kiện vệ sinh an toàn thực phẩm;\r\n	- Hàng hóa đang kinh doanh, hóa đơn chứng từ kèm theo;\r\n	- Nhãn hàng hóa;\r\n	- Niêm yết giá.\r\n', '14h ngày 25/4/2016', 'Tại thời điểm kiểm tra, cơ sở xuất trình:\r\n- Giấy chứng nhận đăng ký hoạt động chi nhánh \r\n- Giấy chứng nhận đủ điều kiện vệ sinh an toàn thực phẩm số 808/2014/ATTP-CNĐK;\r\n	- Hàng hóa đang sản xuất kinh doanh các sản phẩm từ sữa chế biến, thực phẩm chức năng, thực phẩm bổ sung vi chất gồm: kem, sữa chua, sữa tiệt trùng các loại nhãn hiệu Vinamilk có hóa đơn chứng từ kèm theo;\r\n	- Nhãn hàng hóa đúng quy định;\r\n	- Niêm yết giá đúng quy định, có bảng giá tại nhà máy.', 'Không vi phạm', NULL, '2016-06-15 17:18:33', 28, '2016-06-15 17:18:33', 28, NULL, NULL, 0, NULL, NULL),
(101, '2016-04-01 00:00:00', 'Phạm Thị Thu Hiền, Phan Thị Hồng Vân, Đinh Minh Tiến ', 'Tổ trưởng, Kiểm soát viên thị trường ,Kiểm soát viên thị trường', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo;\r\n- Việc nhãn hàng hóa;\r\n- Việc niêm yết giá.\r\n', '8g-10g ngày 01/4/2016', '- Giấy chứng nhận đăng ký doanh nghiệp số: 4101394485 do Sở Kế hoạch và Đầu tư tỉnh Bình Định cấp ngày 22/12/2012.\r\n- Hàng hóa đang kinh doanh tại doang nhiệp gồm: Cầu chì, tủ điện, ổ cắm, công tắc điện, quạt trần, quạt treo, bộ ngắt mạch an toàn các loại, hàng hóa có hóa đơn GTGT số: 0071487 ngày 01/3/2016; số: 0014113 ngày 16/3/2016; số: 000010 ngày 03/3/2016; số: 0071488 ngày 01/3/2016.\r\n- Công ty đang kinh doanh một số mặt hàng: ổ cắm có màng che hiệu WEV 1081, bộ ngắt mạch an toàn HB 20A BS 1112TV có nhãn nhưng bị mờ không đọc được hết các nội dung trên nhãn hàng hóa, gồm:\r\n	+ Ổ cắm có màng che hiệu WEV 108, số lượng: 750 cái x 17.000đồng/1cái = 12.750.000đồng\r\n+  Bộ ngắt mạch an toàn HB 20A BS 1112TV, số lượng: 280 cái x 52.000đồng/1 cái = 14.560.000đồng\r\nTổng giá trị hàng hóa vi phạm: 27.310.000 đồng tính theo giá niêm yết.\r\nCác mặt hàng còn lại có nhãn hàng hóa đúng quy định.\r\n- Công ty thực hiện niêm yết giá hàng hóa đúng quy định bằng hình thức niêm yết trực tiếp trên sản phẩm.\r\n', 'PT:1.500.000 đồng', NULL, '2016-06-16 08:23:04', 28, '2016-06-16 08:23:04', 28, NULL, NULL, 0, NULL, NULL),
(102, '2016-04-04 00:00:00', 'Phạm Thị Thu Hiền, Bùi Thị Bích Ngọc, Đinh Minh Tiến', 'Tổ trưởng, Kiểm soát viên thị trường ,Kiểm soát viên thị trường', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo;\r\n- Việc nhãn hàng hóa;\r\n- Việc niêm yết giá.\r\n', '9g30-11g30', '- Giấy chứng nhận đăng ký kinh doanh hộ kinh doanh cá thể số: 35A8012681 do UBND TP.Quy NHơn cấp ngày 22/01/2015.\r\n- Hàng hóa đang kinh doanh tại cơ sở gồm: áo nam, quần đùi nam, khăn mặt, quần lót nữ, áo ngực nữ các loại, hàng hóa có hóa đơn bán hàng số: 0069077 ngày 17/3/2016, 0056957 ngày 28/01/2016, 0056990 ngày 27/01/2016, 0087128 ngày 13/10/2015.\r\n- Cơ sở kinh doanh mặt hàng áo ngực nữ hiệu Yashugi, số lượng 6.350 cái có nhãn không ghi đủ các nội dung bắt buộc trên nhãn hàng hóa theo quy định (không ghi địa chỉ của tổ chức, cá nhân chịu trách nhiệm về hàng hóa). Đơn giá niêm yết tại thời điểm kiểm tra là 5.000 đồng/cái. \r\nTổng giá trị hàng hóa vi phạm: 31.750.000 đồng tính theo giá niêm yết.\r\nCác mặt hàng còn lại có nhãn hàng hóa đúng quy định.\r\n- Cơ sở thực hiện niêm yết giá hàng hóa đúng quy định bằng hình thức niêm yết trực tiếp trên sản phẩm và có bảng niêm yết giá\r\n', 'PT:1.750.000 đồng', NULL, '2016-06-16 08:51:07', 28, '2016-06-16 08:51:07', 28, NULL, NULL, 0, NULL, NULL),
(103, '2016-04-27 00:00:00', 'Nguyễn Văn Ngọc, ĐInh Minh Tiến', 'Phó Đội trưởng, Kiểm soát viên', '- Giấy chứng nhận đăng ký kinh doanh; \r\n	- Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo;\r\n	- Việc ghãn hàng hóa;\r\n	- Việc niêm yết giá.\r\n', '8 giờ ngày 27/4/2016', '- Giấy chứng nhận đăng ký kinh doanh hộ kinh doanh cá thể số: 35A8004217 đăng ký lần đầu ngày 22/12/2005 do UBND TP. Quy Nhơn cấp (bản chính).\r\n	- Hàng hóa đang kinh doanh gồm đầu máy DVD EUREKA, loa SoundMax, đầu máy Arirang các loại do Việt Nam sản xuất có các hóa đơn bán hàng số 0003382 ngày 26/3/2016, 0010710 ngày 24/4/2016, hóa đơn GTGT số 0013195 ngày 20/4/2016.\r\n	- Hàng hóa đang kinh doanh có ghi nhãn hàng hóa đúng theo quy định.\r\n	- Cửa hàng thực hiện việc niêm yết giá hàng hóa theo đúng quy định bằng hình thức niêm yết trực tiếp trên hàng hóa.\r\n', 'Không vi phạm', NULL, '2016-06-16 09:02:30', 28, '2016-06-16 09:02:30', 28, NULL, NULL, 0, NULL, NULL),
(104, '2016-04-27 00:00:00', 'Phạm Thị Thu Hiền, Phan Thị Hồng Vân', 'Tổ trưởng, Kiểm soát viên', '- Giấy chứng nhận đăng ký kinh doanh; \r\n	- Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo;\r\n	- Việc ghãn hàng hóa;\r\n	- Việc niêm yết giá.\r\n', '9 giờ ngày 27/4/2016', '- Cửa hàng xuất trình Giấy chứng nhận đăng ký kinh doanh hộ kinh doanh cá thể số: 35A801337 do UBND thành phố Quy Nhơn cấp đăng ký thay đổi lần thứ nhất ngày 18/01/2016 ( Bản chính).\r\n	- Hàng hóa đang kinh doanh tại cửa hàng gồm: Nồi cơm điện, máy làm mát không khí, bàn ủi, máy sinh tố, máy sấy, máy lạnh, lò nướng các loại . Hàng hóa có các hóa đơn GTGT; bán hàng ( liên 2, bản chính) số: 0097680 ngày 25/4/2016; số: 0000101; số 0000102 ngày 26/4/2016; số: 0000098 ngày 25/4/2016; số: 0000659 ngày 15/3/2016; số: 0006440 ngày 22/4/2016; số: 0000179 ngày 21/4/2016; số: 0097679 ngày 25/4/2016.\r\n	- Hàng hóa đang kinh doanh có nhãn, có dấu hợp quy, có dấu tem năng lượng đúng quy định.\r\n	- Cửa hàng thực hiện việc niêm yết giá hàng hóa theo đúng quy định  bằng hình thức niêm yết giá trực tiếp trên từng sản phẩm.\r\n', 'Không vi phạm', NULL, '2016-06-16 09:14:41', 28, '2016-06-16 09:14:41', 28, NULL, NULL, 0, NULL, NULL),
(105, '2016-04-28 00:00:00', 'Nguyễn Văn Ngọc, ĐInh Minh Tiến', 'Tổ trưởng, Kiểm soát viên', '- Giấy chứng nhận đăng ký kinh doanh; \r\n	- Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo;\r\n	- Việc ghãn hàng hóa;\r\n	- Việc niêm yết giá.\r\n', '7h30, ngày 28/4/2016', 'Công ty xuất trình:\r\n- Giấy chứng nhận đăng ký kinh doanh; \r\n	- Hàng hóa đang kinh doanh: tủ lạnh, máy giặt, máy lạnh co hóa đơn chứng từ kèm theo;\r\n	- Việc ghãn hàng hóa: hàng hoá có nhãn, có dâu hợp quy, có tem năng lượng;\r\n	- Việc niêm yết giá: đúng quy định, niêm yết trực tiếp trên sản phẩm.\r\n', 'không vi phạm', NULL, '2016-06-16 09:35:42', 28, '2016-06-16 09:35:42', 28, NULL, NULL, 0, NULL, NULL),
