(109, '2016-05-05 00:00:00', 'Nguyễn Văn Ngọc, ĐInh Minh Tiến', 'Tổ trưởng, Kiểm soát viên', '- Giấy chứng nhận đăng ký kinh doanh; \r\n	- Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo;\r\n	- Việc ghãn hàng hóa;\r\n	- Việc niêm yết giá.\r\n', '13h45-15h30', '+ Cơ sở xuất trình các loại giấy tờ sau:\r\n	- Giấy chứng nhận đăng ký doanh nghiệp  số: 4100475974 do Sở KH và ĐT  Bình Định cấp đăng ký thay đổi lần thứ tư ngày 17/11/2015 ( Bản chính).\r\n		- Hàng hóa đang kinh doanh tại Công ty gồm:Bồn vệ sinh ,gạch men , sơn các loại ,hàng hóa có hóa đơn giá trị gia tăng kèm theo số:0003340 ngày 22/4/2016, số:0011482 ngày 21/4/2016, số 0001280 ngày 8/4/2016, số:0001289 ngày 9/4/2016(liên 2 bản chính ), hóa đơn bán hàng số:0093052 ngày 04/5/2016(liên 2 bản chính)\r\n         - Hàng hóa kinh doanh tại công ty có nhãn hàng hóa đúng quy định của pháp luật về nhãn hàng hóa.\r\n	- Cơ sở thực hiện việc niêm yết giá hàng hóa theo đúng quy định  bằng hình thức niêm yết giá trực tiếp trên từng sản phẩm, niêm yết từng loại sản phẩm.\r\n', 'Không vi phạm', NULL, '2016-06-16 10:16:54', 28, '2016-06-16 10:16:54', 28, NULL, NULL, 0, NULL, NULL),
(110, '2016-04-06 00:00:00', 'Phạm Thị Thu Hiền, Phan Thị Hồng Vân', 'Tổ trưởng, Kiểm soát viên thị trường ', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo;\r\n- Việc nhãn hàng hóa;\r\n- Việc niêm yết giá.\r\n', '10g06-11g30', '- Chủ cơ sỏ xuất trình giấy chứng nhận đăng ký kinh doanh hộ kinh doanh cá thể số: 35A8012044 do UBND TP.Quy Nhơn cấp ngày 30/12/2013 ( bản chính).\r\n- Hàng hóa đang kinh doanh tại cơ sở gồm: áo thun nam, nữ, quần nam, nữ, áo mí nữ đủ kiểu các loại, hàng hóa có hóa đơn bán hàng ( liên 2 bản chính) số: 0000351 ngày 02/01/2015; 0000372 ngày 20/5/2015;  0000395 ngày 09/11/2015, 0072369  ngày 18/03/2016.\r\n- Cơ sở kinh doanh mặt hàng áo mí nữ các loại, số lượng 250 cái; quần nữ hiệu PHUC-LE SUIT,số lượng: 50 Cái có nhãn không ghi đủ các nội dung bắt buộc trên nhãn hàng hóa theo quy định (không ghi tên và địa chỉ của tổ chức, cá nhân chịu trách nhiệm về hàng hóa). . Đơn giá niêm yết tại thời điểm kiểm tra niêm yết trực tiếp trên từng sản phẩm, cụ thể: \r\nÁo mí nữ hiệu NON STOP, số lượng: 100 cái x 90.000đồng/cái = 9.000.000 đồng\r\nÁo mí nữ hiệu CIROS, số lượng: 50 cái x 70.000đồng/cái = 3.500.000 đồng\r\nÁo mí nữ hiệu Z-ONE, số lượng: 100 cái x 80.000đồng/cái = 8.000.000 đồng\r\nQuần nữ hiệu PHUC-LE SUIT, số lượng: 50 cái x 80.000đồng/cái = 4.000.000đồng\r\nTổng giá trị hàng hóa vi phạm: 24.500.000 đồng tính theo giá niêm yết.\r\nCác mặt hàng còn lại có nhãn hàng hóa đúng quy định.\r\n- Cơ sở thực hiện niêm yết giá hàng hóa đúng quy định bằng hình thức niêm yết trực tiếp trên sản phẩm và có bảng niêm yết giá.\r\n', 'PT: 750.000 đồng', NULL, '2016-06-16 10:18:00', 28, '2016-06-16 10:18:00', 28, NULL, NULL, 0, NULL, NULL),
(111, '2016-05-04 00:00:00', 'Phạm Thị Thu Hiền, Phan Thị Hồng Vân', 'Tổ trưởng, Kiểm soát viên', '- Giấy chứng nhận đăng ký kinh doanh; \r\n	- Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo;\r\n	- Việc ghi nhãn hàng hóa;\r\n	- Việc niêm yết giá.\r\n', '07h30-11h00', '- Giấy chứng nhận đăng ký doanh nghiệp công ty TNHH một thành viên số: 41014169645 do Sở kế hoạch và Đầu tư Bình Định cấp đăng ký thay đổi lần thứ 3 ngày 19/4/2016..\r\n	- Hàng hóa đang kinh doanh tại công ty gồm: gạch lát, gạch ốp, xi măng Phúc Sơn, lưới rào, sắt phi 6 mm, sát phi 8 mm, xi măng KAITO các loại do Việt Nam sản xuất, có các hóa đơn GTGT số: 0016291 ngày 31/3/2016, 0011595 ngày 02/4/2016, 0000911 ngày 20/4/2016, 0001529 ngày 12/4/2016, 0004650 ngày 24/4/2016\r\n 	- Hàng hóa đang kinh doanh có nhãn hàng hóa đúng theo quy định.\r\n	- Công ty có thực hiện việc niêm yết giá hàng hóa theo đúng quy định  bằng hình thức niêm yết trực tiếp trên từng hàng hóa và có bảng niem yết giá bằng mica treo công khai tại công ty.\r\n', 'Không vi phạm', NULL, '2016-06-16 10:24:47', 28, '2016-06-16 10:24:47', 28, NULL, NULL, 0, NULL, NULL),
