(113, '2016-04-07 00:00:00', 'Nguyễn Văn Ngọc, Đinh Minh Tiến ', 'Tổ trưởng, Kiểm soát viên thị trường ', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo;\r\n- Việc nhãn hàng hóa;\r\n- Việc niêm yết giá\r\n', '13g30-15g', '- Công ty xuất trình giấy chứng nhận đăng ký doanh nghiệp Công ty TNHH hai thành viên trở lên số: 4100265864 do Sở Kế hoạch và Đầu tư tỉnh Bình Định cấp đăng ký thay đổi lần thứ 6 ngày 08/12/2014.\r\n- Hàng hóa đang kinh doanh tại công ty gồm: Gạch ốp lát, bồn cầu, chậu rửa chén, vòi rửa chén, Chân lavabo, gương. Hàng hóa có hóa đơn giá trị gia tăng ( liên 2 bản chính)  số: 0004427 ngày 23.02.2016; 0005087 ngày 25.02.2016; 0005169 ngày 10.03.201; 0000136 ngày 16.3.2016\r\n- Công ty đang kinh doanh mặt hàng Bàn cầu C918 VRN-1 màu trắng có nhãn nhưng bị mờ không đọc được các nội dung trên nhãn hàng hóa, số lượng: 04 bộ, Đơn giá niêm yết tại thời điểm kiểm tra là 5.300.000đồng/bộ . Tổng giá hàng hóa vi phạm là 21.200.000đồng tính theo giá niêm yết. Các mặt hàng còn lại có nhãn hàng hóa đúng quy định.\r\n- Công ty thực hiện niêm yết giá hàng hóa đúng quy định bằng hình thức niêm yết trực tiếp trên sản phẩm.\r\n', 'PT:1.500.000 đồng', NULL, '2016-06-16 10:46:26', 28, '2016-06-16 10:46:26', 28, NULL, NULL, 0, NULL, NULL),
