(115, '2016-04-05 00:00:00', 'Phạm Thị Thu Hiền, Bùi Thị Bích Ngọc, Đinh Minh Tiến', 'Tổ trưởng, Kiểm soát viên thị trường ,Kiểm soát viên thị trường', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Giấy chứng nhận đủ điều kiện;\r\n- Hàng hóa đang kinh doanh, hóa đơn chứng từ kèm theo;\r\n- Nhãn hàng hóa;\r\n- Niêm yết giá.\r\n', '8g-10g30', '- Giấy chứng nhận đăng ký kinh doanh hộ kinh doanh cá thể số: 35A8009250 do UBND TP.Quy Nhơn cấp ngày 25/6/2009.\r\n- Giấy chứng nhận đủ điều kiện kinh doanh thuốc só: 268/BĐ-DDKKDDDD ngày 15/12/2014 do Sở Y tế tỉnh Bình Định cấp có giá trị từ 15/12/2014.\r\n- Hàng hóa đang kinh doanh tại gồm: thuốc tân dược các loại. hàng hóa có hóa đơn GTGT số: 0035101 ngày 07/3/2016, 0157409 ngày 07/3/2106, 0169209 ngayf10/3/2016, 0112891 ngày 07/3/2016.\r\n- Hàng hóa có nhãn hàng hóa đúng quy định.\r\n- Cơ sở thực hiện niêm yết giá hàng hóa đúng quy định bằng hình thức niêm yết trực tiếp trên sản phẩm.\r\n* Tại thời điểm kiểm tra tổ kiểm tra phát hiện Nhà thuốc Thanh Thủy không thực hiện việc mở sổ để theo dõi hoạt động mua, bán thuốc theo quy định của pháp luật năm 2016.\r\n', 'PT:4.000.000 đồng', NULL, '2016-06-16 11:06:20', 28, '2016-06-16 11:06:20', 28, NULL, NULL, 0, NULL, NULL),
