(119, '2016-03-29 00:00:00', 'Nguyễn Văn Ngọc, Đinh Minh Tiến , Phạm Thị Thu Hiền', 'Tổ trưởng, Kiểm soát viên thị trường ,P.Đội trưởng ', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo;\r\n- Nhãn hàng hóa;\r\n- Niêm yết giá.\r\n', '13g30-15g30', '- Giấy chứng nhận đăng ký kinh doanh số :02968/HKD ngày 04/4/2002\r\n- Hàng hóa đang kinh doanh gồm :đèn trang trí gắn tường, quạt điện, đui công tắc, đèn pin cầm tay,...hàng hóa có hóa đơn kèm theo\r\n- Qua kiểm tra tổ kiểm tra phát hiện cơ sở đang kinh doanh mặt hàng đồ điện là hàng nhập khẩu có nhãn gốc bằng tiếng nước ngoài nhưng không có nhãn phụ bằng tiếng Việt Nam. Hàng hóa vi phạm có giá trị là 24.850.000 đồng.\r\n- cơ sở có thực hiện việc niêm yết giá đúng quy định.', 'PT: 750.000 đồng', NULL, '2016-06-16 14:31:51', 28, '2016-06-16 14:31:51', 28, NULL, NULL, 0, NULL, NULL),
