(126, '2016-04-12 00:00:00', 'Phạm Thị Thu Hiền, Phan Thị Hồng Vân', 'Tổ trưởng, Kiểm soát viên thị trường ', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo;\r\n- Nhãn hàng hóa;\r\n- Niêm yết giá.\r\n', '08g30-13g00', '- Cửa hàng xuất trình Giấy chứng nhận đăng ký kinh doanh hộ kinh doanh cá thể số: 35A8012972 do UBND thành phố Quy Nhơn cấp đăng ký lần đầu ngày 29/7/2015.\r\n	- Hàng hóa đang kinh doanh tại cơ sở gồm: áo sơ mi các loại, quần bò ngắn các loại, áo khoác các loại do Việt Nam sản xuất có các hóa đơn bán hàng số 0036092 ngày 17/12/2015 ( liên 2, bản chính). Riêng 41 chiếc quần Jean dài các loại do Trung quốc sản xuất ( made in China) không có hóa đơn chứng từ kèm theo, có nhãn gốc bằng tiếng nước ngoài nhưng không có nhãn phụ bằng tiếng Việt Nam, cụ thể: \r\n	+ Quần Jean dài hiệu Fashion Jeans, số lương: 05 chiếc, giá niêm yết 300.000đồng/chiếc;\r\n+ Quần jean dài hiệu JFNAS AB 91, số lượng: 04 chiếc, giá niêm yết 320.000 đồng/chiếc;\r\n+ Quần jean dài hiệu PHILIPP PLEIN COUTURE, số lượng: 03 chiếc, giá niêm yết 350.000 đồng/chiếc;\r\n+ Quần jean dài hiệu PEBLAY, số lượng: 02 chiếc, giá niêm yết 350.000 đồng/chiếc;\r\n+ Quần jean dài hiệU VERSACE, số lượng: 02 chiếc, giá niêm yết 320.000 đồng/chiếc;\r\n+ Quần jean dài hiệu FASHION CLASSIC, số lượng: 03 chiếc, giá niêm yết 300.000 đồng/chiếc;\r\n+ Quần jean dài hiệu FASHION JEANS 1984, số lượng: 03 chiếc, giá niêm yết 300.000 đồng/chiếc;\r\n+ Quần jean dài hiệu VEPSACF, số lượng: 04 chiếc, giá niêm yết 320.000 đồng/chiếc;\r\n+ Quần jean dài hiệu GCOOT, số lượng: 04 chiếc, giá niêm yết 300.000 đồng/chiếc;\r\n+ Quần jean dài hiệu BURBERRY, số lượng: 03 chiếc, giá niêm yết 350.000 đồng/chiếc;\r\n+ Quần jean dài hiệu DSQBREAD 2 MILANO, số lượng: 05 chiếc, giá niêm yết 320.000 đồng/chiếc;\r\n+ Quần jean dài hiệu DSQBREAD 2-1964, số lượng: 03 chiếc, giá niêm yết 320.000 đồng/chiếc;\r\nToàn bộ số lượng hàng hóa trên không rõ chất lượng.\r\nTổng giá trị hàng hóa: 13.060.000 đồng tính theo giá niêm yết tại cửa hàng.\r\n- Niêm yết giá hàng hóa đúng quy định ( niêm yết giá trực tiếp trên từng hàng hóa)\r\n', 'Tịch thu toàn bộ hàng hóa vi phạm va phạt 4.000.000 đồng.', NULL, '2016-06-16 15:48:25', 28, '2016-06-16 15:48:25', 28, NULL, NULL, 0, NULL, NULL),
(127, '2016-05-18 00:00:00', 'Nguyễn Văn Ngọc, Phạm Văn Hồng, ĐInh Minh Tiến', 'Tổ trưởng, Đội trưởng, Kiểm soát viên', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Giấy chứng nhận đủ điều kiện kinh doanh\r\n- Giấy chứng nhận tập huấn kiến thức ĐLCL, PCCC, BVMT\r\n	- Hàng hóa đang kinh doanh, hóa đơn chứng từ kèm theo;\r\n	- Nhãn hàng hóa;\r\n	- Niêm yết giá.\r\n', '8h00-11h00', '- Giấy chứng nhận đăng ký doanh nghiệp công ty cổ phần số:4101446750 do Sở Kế hoạch và Đầu tư tỉnh Bình Định cấp ngày 22/07/2015.\r\n         - Giấy chứng nhận đủ điều kiện kinh donh khí dầu mỏ hóa lỏng số: 454/GCNĐĐK-BQL do ban quản lý khu kinh tế cấp ngày 11/03/2016 có giá trị  đến hết ngày 10/03/2021.\r\n         - Giấy chứng nhận huấn luyện nghiệp vụ PCCC số : 0278704; số:0147939; số :0144480 mang tên Phạm Văn Đức; Võ Trung Yên; Nguyến Đình Phương.\r\n        - Giấy chứng nhận huấn luyện ĐLCL; BVMTC số : 02059; số:74212; số :77908 mang tên Phạm Văn Đức; Võ Trung Yên; Nguyến Đình Phương.\r\n	- Hàng hóa đang kinh doanh tại công ty gồm: khí hóa lỏng LPG có hóa đơn GTGT số: 0006305 ngày 18/04/2016; số :0006216 ngày 11/04/2016( bản chính liên 2)\r\n          - Hàng hóa có đăng ký nhãn hiệu hàng hóa số :59582 có giá trị đến 31/12/2023(bản chính)nhãn hiệu(PT Gas) .\r\n	- Công ty thực hiện việc niêm yết giá hàng hóa theo đúng quy định(có bản niêm yết giá và đăng ký giá của sở tài chính).\r\n', 'Không vi phạm', NULL, '2016-06-16 15:55:30', 28, '2016-06-16 15:55:30', 28, NULL, NULL, 0, NULL, NULL),
