(142, '2016-05-26 00:00:00', 'Nguyễn Văn Ngọc, Phạm Văn Hồng, ĐInh Minh Tiến', 'Tổ trưởng, Đội trưởng, Kiểm soát viên', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Giấy chứng nhận đủ điều kiện kinh doanh\r\n- Giấy chứng nhận tập huấn kiến thức ĐLCL, PCCC, BVMT\r\n	- Hàng hóa đang kinh doanh, hóa đơn chứng từ kèm theo;\r\n	- Nhãn hàng hóa;\r\n	- Niêm yết giá.\r\n', '8h00-10h30', '- Giấy chứng nhận đăng ký doanh nghiệp số:4100509990 do Sở Kế hoạch và Đầu tư tỉnh Bình Định cấp đăng ký thay đổi lần thứ 4 ngày 14/5/2014.\r\n         - Giấy chứng nhận đủ điều kiện kinh doanh khí dầu mỏ hóa lỏng số: 1998/GCNĐĐK-BQL do ban quản lý khu kinh tế cấp ngày 18/9/2015 có giá trị  đến hết ngày 11/9/2012.\r\n         - Giấy chứng nhận huấn luyện nghiệp vụ PCCC số : 0144126; số:0360725 do CSPC và CC T.Bình Định cấp cho Ông  Châu Văn Thiện ngày 29/12/2014 ; Ông Võ Kế Giàu ngày 01/12/2015(bản chính)\r\n        - Giấy chứng nhận huấn luyện ĐLCL; BVMTC số : 84039; số:84018 do trường cao đẳng thương mại cấp cho Ông Châu Văn Thiện; Ông Võ Kế Giàu ngày 21/08/2015.\r\n	- Hàng hóa đang kinh doanh tại công ty gồm: Gas chai(LPG) nhãn hiệu GCN Futagasco có đăng ký nhãn hiệu hàng hóa số:68620 do cục sở hửu trí tuệ cấp có giá trị đến ngày 25/8/2024.Hàng hóa có hóa đơn GTGT số: 0040056 ngày 01/04/2016; số :0040057 ngày 01/04/2016; số: 0040063 ngày 02/4/2016; số: 0040066 ngày 04/4/2016( bản chính liên 2)\r\n	- Công ty thực hiện việc niêm yết giá hàng hóa theo đúng quy định(có bản niêm yết giá và đăng ký giá của sở tài chính).\r\n', 'Không vi phạm', NULL, '2016-06-17 13:48:14', 28, '2016-06-17 13:48:14', 28, NULL, NULL, 0, NULL, NULL),
