(157, '2016-01-14 00:00:00', 'Nguyễn Văn Danh, Nguyễn Văn Ngọc, Đinh Minh Tiến', 'Tổ trưởng ,P.Đội trưởng , kiểm soát viên thị trường', '- Giấy chứng nhận đăng ký kinh doanh hộ kinh doanh;\r\n- Giấy chứng nhận đủ điều kiện vệ sinh an toàn thực phẩm;\r\n- Giấy phép bán lẻ sản phẩm thuốc lá;\r\n- Hàng hóa đang kinh doanh, hóa đơn chứng từ liên quan đến hàng hóa;\r\n- Nhãn hàng hóa;\r\n- Niêm yết giá..\r\n', '13g30-14g10 ngày 14/01/2016', '- Chủ hộ kinh doanh đang kinh doanh mặt hàng (bia, nước giải khát, sữa chế biến, bánh, kẹo) thuộc mặt hàng kinh doanh có điều kiện dưới hình thức hộ kinh doanh mà không có giấy chứng nhận đăng ký kinh doanh.\r\n- Hàng hóa đang kinh doanh: bia Heineken lon, bánh Kinh Đô, bánh Cosy Marie, kẹp socola, nước yến Sanest, sữa,… các loại sản xuất ở Việt nam. Hàng hóa có hóa đơn GTGT số: 0000183 ngày 06/01/2015, 0000114 ngày 31/12/2015, 0000999 ngày 05/01/2016, 0006646 ngày 12/12/2105. Tại thời điểm kiểm tra cơ sở không có mua bán mặt hàng thuốc lá nên không có Giấy phép bán lẻ sản phẩm thuốc lá.\r\n- Hàng hóa đang kinh doanh có nhãn hàng hóa đúng theo quy định.\r\n- Cơ sở thực hiện việc niêm yết giá hàng hóa theo đúng quy định.\r\n- Cơ sở thuộc diện kinh doanh thực phẩm nhỏ lẻ được quy định tại điểm a khoản 3 Điều 2 Thông tư số 58/2014/TT-BCT ngày 22/12/2014 của Bộ Công thương nên không thuộc diện cấp.\r\n', 'PT: 5000.000 đồng', NULL, '2016-06-20 10:30:01', 28, '2016-06-20 10:30:01', 28, NULL, NULL, 0, NULL, NULL),
(158, '2016-05-25 00:00:00', 'Nguyễn Văn Ngọc, ĐInh Minh Tiến', 'Tổ trưởng, Kiểm soát viên', '- Giấy chứng nhận đăng ký kinh doanh; \r\n	- Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo;\r\n	- Nhãn hàng hóa;\r\n	- Niêm yết giá.\r\n', '8h30- 10h30', '- Giấy chứng nhận đăng ký kinh doanh hộ kinh doanh cá thể số : 35A8009399 do UBND TP.Quy Nhơn cấp ngày 26/06/2013.\r\n	- Hàng hóa đang kinh doanh tại cơ sở gồm : Máy giặt, Tivi, Tủ lạnh, nồi cơm điện, máy điều hòa không khí các loại. Hàng hóa có hóa đơn gtgt  liên 2 số:0001645 ngày 08/10/2015; số:0004607 ngày 15/03/2016; số:0000358 ngày 16/03/2016; số:0000027 ngày 15/03/2016; số: 0024561 ngày 23/4/2016; số:0024558 ngày 23/4/2016.\r\n	- Hàng hóa đang kinh doanh có nhãn hàng hóa đúng theo quy định, có nhãn năng lượng, có dấu hợp quy.\r\n	- Cơ sở thực hiện việc niêm yết giá hàng hóa theo đúng quy định(hình thức niêm yết trực tiếp trên từng sản phẩm).\r\n', 'Không vi phạm', NULL, '2016-06-20 10:37:04', 28, '2016-06-20 10:37:04', 28, NULL, NULL, 0, NULL, NULL),
(159, '2016-05-24 00:00:00', 'Nguyễn Văn Ngọc, ĐInh Minh Tiến', 'Tổ trưởng, Kiểm soát viên', '- Giấy chứng nhận đăng ký kinh doanh; \r\n	- Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo;\r\n	- Nhãn hàng hóa;\r\n	- Niêm yết giá.\r\n', '8h00-10h30', '- Giấy chứng nhận đăng ký hoạt động chi nhánh  số:3702167213-001 do Sở Kế hoạch và Đầu tư tỉnh Bình Định cấp ngày 25/02/2016.\r\n	- Hàng hóa đang kinh doanh tại công ty gồm: Thép hộp mạ kẽm, thép ống mạ kẽm ,hàng hóa có hóa đơn GTGT bản chính, liên 2 số: 0000041 ngày 07/03/2016, 0004545 ngày 26/02/2015, 0004427 ngày 03/02/2016, 0000088 ngày 11/03/2016.\r\n	- Hàng hóa đang kinh doanh có nhãn hàng hóa đúng quy định.\r\n	- Chi nhánh Công ty thực hiện việc niêm yết giá hàng hóa theo đúng quy định(hình thức có bản niêm yết tại nơi quy định).\r\n', 'Không vi phạm', NULL, '2016-06-20 10:46:28', 28, '2016-06-20 10:46:28', 28, NULL, NULL, 0, NULL, NULL),
