(161, '2016-01-15 00:00:00', 'Nguyễn Văn Danh, Nguyễn Văn Ngọc, Đinh Minh Tiến', 'Tổ trưởng ,P.Đội trưởng , kiểm soát viên thị trường', '- Giấy chứng nhận đăng ký doanh nghiệp;\r\n- Giấy chứng nhận đủ điều kiện vệ sinh an toàn thực phẩm;\r\n- Giấy phép kinh doanh sản phẩm rượu;\r\n- Hàng hóa đang kinh doanh, hóa đơn chứng từ liên quan đến hàng hóa;\r\n- Nhãn hàng hóa;\r\n- Niêm yết giá..\r\n', '9g30-11g', '- Giấy chứng nhận đăng ký doanh nghiệp công ty TNHH Một thành viên số: 4101452306 đăng ký lần đầu ngày 05/11/2015 do Phòng Đăng ký kinh doanh Sở kế hoạch và Đầu tư tỉnh Bình Định cấp.\r\n- Giấy phép bán lẻ sản phẩm rượu số 137/GP-PKT ngày 24/12/2015 do Phòng Kinh tế UBND TP. Quy Nhơn cấp có giá trị đến hết ngày 23/12/2020.\r\n- Hàng hóa đang kinh doanh tại công ty gồm: Rượu vang, rượu whisky, rượu cognac các loại, do nước ngoài sản xuất, có hóa đơn GTGT số: 0013372 ngày 21/11/2015, 0011654 ngày 02/11/2015, 0006320 ngày 12/01/2016, 0002451 ngày 19/12/2015.\r\n- Công ty không kinh doanh mặt hàng công nghệ thực phẩm nen không có giấy chứng nhận đủ điều kiện vẹ sinh an toàn thực phẩm.\r\n- Hàng hóa đang kinh doanh có nhãn hàng hóa đúng theo quy định, có tem rượu nhập khẩu.\r\n- Niêm yết giá hàng hóa theo đúng quy định ( niêm yết giá trực tiếp trên từng hàng hóa).\r\nCông ty thực hiện niêm yết bản sao hợp lệ giấy phép kinh doanh sản phảm rượu, chủng loại rượu, giá các loại rượu đang bán tại địa điểm kinh doanh theo quy định pháp luật.\r\n', 'Không vi phạm ', NULL, '2016-06-20 11:09:22', 28, '2016-06-20 11:09:22', 28, NULL, NULL, 0, NULL, NULL),
