(166, '2016-01-12 00:00:00', 'Nguyễn Văn Danh, Nguyễn Văn Ngọc, Đinh Minh Tiến, Phan Thị Hồng Vân', 'Tổ trưởng ,P.Đội trưởng , kiểm soát viên thị trường, kiểm soát viên thị trường', '- Giấy chứng nhận đăng ký kinh doanh hộ kinh doanh;\r\n- Hàng hóa đang kinh doanh, hóa đơn chứng từ liên quan đến hàng hóa;\r\n- Nhãn hàng hóa;\r\n- Niêm yết giá..\r\n', '14g-18g', '- Tại thời điểm kiểm tra, chủ sơ sở xuất trình Giấy tiếp nhận hồ sơ và hẹn trả kết quả số: 1610600033/TNHS ngày 08/01/2016 do Bộ phận tiếp nhận và trả kết quả Văn phòng HĐND và UBND TP. Quy Nhơn cấp. Chủ cơ sở chưa xuất trình được Giấy chứng nhận đăng ký kinh doanh hộ kinh doanh cá thể.\r\n- Tại thời điểm kiểm tra, hàng hóa đang kinh doanh tại cơ sở gồm: quần jean các loại, do nước ngoài sản xuất, không có hóa đơn chứng từ kèm theo. Cụ thể gồm:\r\nQuần jean hiệu DSQUARED, made in China, số lượng 05 chiếc, giá niêm yết 390.000 đồng/chiếc;\r\nQuần jean hiệu DSQUARED, made in China, số lượng 04 chiếc, giá niêm yết 395.000 đồng/chiếc;\r\nQuần jean hiệu BURBERRY, made in China, số lượng 02 chiếc, giá niêm yết 430.000 đồng/chiếc;\r\nQuần jean hiệu DSQUARED2, made in China, số lượng 03 chiếc, giá niêm yết 390.000 đồng/chiếc;\r\nQuần jean hiệu DIESEL INDUSTRY, made in China, số lượng 05 chiếc, giá niêm yết 390.000 đồng/chiếc;\r\nQuần jean hiệu MONCLER, made in China, số lượng 03 chiếc, giá niêm yết 395.000 đồng/chiếc;\r\nQuần jean hiệu ERMARA, made in China, số lượng 06 chiếc, giá niêm yết 390.000 đồng/chiếc;\r\nQuần jean hiệu DOLCE&GABBANA, made in China, số lượng 08 chiếc, giá niêm yết 395.000 đồng/chiếc.\r\nToàn bộ số lượng hàng hóa trên không rõ chất lượng.\r\nTổng giá trị hàng hóa: 14.195.000 đồng tính theo giá niêm yết tại cơ sở.\r\n- Hàng hóa đang kinh doanh tại cơ sở có nhãn gốc bằng tiếng nước ngoài nhưng không có nhãn phụ bằng tiếng Việt Nam.\r\n- Niêm yết giá hàng hóa đúng quy định ( niêm yết giá trực tiếp trên từng hàng hóa)\r\nTổng giá trị hàng hóa: 14.848.000 đồng tính theo giá niêm yết tại cơ sở.\r\n'