(176, '2016-05-20 00:00:00', 'Nguyễn Văn Ngọc, Phạm Văn Hồng, ĐInh Minh Tiến', 'Tổ trưởng, Đội trưởng, Kiểm soát viên', '- Giấy chứng nhận đăng ký kinh doanh; \r\n	- Hàng hóa đang kinh doanh, hóa đơn chứng từ kèm theo;\r\n	- Nhãn hàng hóa;\r\n	- Niêm yết giá.\r\n', '8h00-10h00', '- Doanh nghiệp cung cấp Giấy chứng nhận đăng ký doanh nghiệp  số 4100389549 do sở Kế hoạch và Đầu tư Bình Định cấp và đăng ký thay đổi lần thứ tư ngày 15/04/2013(bản chính)\r\n- Hàng hóa đang kinh doanh tại doanh nghiệp gồm:Thép D6, D8; thép mạ kẽm; thép mạ kẽm xả băng, thép mạ nhôm kẽm phủ sơn, thép cuộn Q6,Q8. Hàng hóa có hóa đơn GTGT số: 0000540 ngày 04/05/2016, 0001823 ngày 05/05/2016, 0004645 ngày 05/05/2016, 0000668 ngày 06/05/2016, 0001331 ngày 09/05/2016(liên 2 bản chính).\r\n- Tại thời điểm kiểm tra tổ kiểm tra phát hiện doanh nghiệp đang kinh doanh mặt hàng : Thép mạ kẽm xả băng, loại 2ly 45, số lượng :1.684 kg đơn giá niêm yết tại thời điểm kiểm tra :14.850 đồng/kg, giá trị: 25.007.400 đồng có nhãn không ghi đủ các nội dung bắt buộc trên nhãn hàng hóa theo quy định của pháp luật về nhãn hàng hóa.\r\nCác mặt hàng còn lại có nhãn hàng hóa đúng quy định.\r\n- Cửa hàng thực hiện niêm yết giá hàng hóa đúng quy định(Hình thức có bản niêm yết giá và  niêm yết trực tiếp trên sản phẩm).\r\n', 'Phạt tiền; 1.500.000 đồng', NULL, '2016-06-22 15:16:18', 28, '2016-06-22 15:16:18', 28, NULL, NULL, 0, NULL, NULL),
(177, '2016-05-17 00:00:00', 'Nguyễn Văn Ngọc, Phan Thị hồng Vân', 'Tổ trưởng, Kiểm soát viên', '- Giấy chứng nhận đăng ký kinh doanh; \r\n	- Hàng hóa đang kinh doanh, hóa đơn chứng từ kèm theo;\r\n	- Nhãn hàng hóa;\r\n	- Niêm yết giá.\r\n', '7h30-11h00', 'UBND thành phố Quy Nhơn cấp đăng ký lần đầu ngày 17/9/2014.\r\n- Hàng hóa đang kinh doanh tại cửa hàng gồm: áo sơ mi, áo pull, quần short các loại do Việt Nam sản xuất, có các hóa đơn bán hàng số 0082940 ngày 08/01/2016, 0082914 ngày 19/11/2015, 0048305 ngày 10/7/2015 ( liên 2, bản chính).\r\n- Mặt hàng quần short các loại, áo sơ mi lụa voan có nhãn không khi đủ các nội dung bắt buộc trên nhãn hàng hóa ( không ghi địa chỉ của tổ chức, cá nhân chịu trách nhiệm về hàng hóa). Cụ thể gồm:\r\n+ Quần short caro hiệu CARO: số lượng 20 cái, giá niêm yết 220.000 đồng/cái\r\n+ Quần short mềm hiệu ARMY: số lượng 22 cái, giá niêm yết 200.000 đồng/cái.\r\n+ Quần short jean hiệu T&T: số lượng 10 cái, giá niêm yết 300.000 đồng/cái.\r\n+ Quần short kaki hiệu Marble: số lượng 20 cái, giá niêm yết 220.000 đồng/cái.\r\n+ Áo sơ mi lụa voan hiệu Dinlailun: số lượng 20 cái, giá niêm yết 250.000 đồng/cái.\r\n Tổng giá trị hàng hóa vi phạm 21.200.000 đồng tính theo giá niêm yết tại cửa hàng.\r\nCác mặt hàng còn lại có nhãn hàng hóa đúng quy định.\r\n- Cửa hàng thực hiện niêm yết giá hàng hóa đúng quy định bằng hình thức niêm yết trực tiếp trên từng hàng hóa.\r\n', 'Phạt tiền:750.000 đồng', NULL, '2016-06-22 15:27:55', 28, '2016-06-22 15:27:55', 28, NULL, NULL, 0, NULL, NULL),
(178, '2016-05-18 00:00:00', 'Phạm Thị Thu Hiền, Phan Thị Hồng Vân', 'Tổ trưởng, Kiểm soát viên', '- Giấy chứng nhận đăng ký kinh doanh; \r\n	- Hàng hóa đang kinh doanh, hóa đơn chứng từ kèm theo;\r\n	- Nhãn hàng hóa;\r\n	- Niêm yết giá.\r\n', '7h30-10h30', '	- Cửa hàng xuất trình Giấy chứng nhận đăng ký kinh doanh hộ kinh doanh cá thể số: 35A8013137 do UBND thành phố Quy Nhơn cấp đăng ký lần đầu ngày 21/10/2015.\r\n	- Hàng hóa đang kinh doanh tại cửa hàng gồm: kem ủ tóc Hairsille, oxy trợ nhuộm tóc Hairsille, nước rửa móng tay QUYEN, kem cạo râu Familiar, bột vẽ Lady Care, sơn móng tay Lady Care, nước pha Felina Ohlala, kem nhuộm Leder, nhuộm Spaline, kem tạo kiểu Leder, dầu bóng Leder, dầu bóng Spaline, xịt dưỡng Leder các loại do Việt Nam sản xuất, có các hóa đơn bán hàng số: 0049266 ngày 13/5/2016, 0063863, 0063864, 0063865, 0063866 ngày 17/5/2016, hóa đơn GTGT số; 0004236 ngày 30/3/2016, 0000260 ngày 11/5/2016, 0040167 ngày 04/7/2015(bản chính, liên 2).\r\n	- Hàng hóa đang kinh doanh có nhãn hàng hóa đúng theo quy định, còn hạn sử dụng.\r\n	- Cửa hàng thực hiện việc niêm yết giá hàng hóa theo đúng quy định  bằng hình thức niêm yết giá trực tiếp trên từng hàng hóa.\r\n', 'Không vi phạm', NULL, '2016-06-22 15:32:25', 28, '2016-06-22 15:32:25', 28, NULL, NULL, 0, NULL, NULL),
(179, '2016-05-19 00:00:00', 'Phạm Thị Thu Hiền, Phan Thị Hồng Vân', 'Tổ trưởng, Đội trưởng, Kiểm soát viên', '- Giấy chứng nhận đăng ký kinh doanh; \r\n	- Hàng hóa đang kinh doanh, hóa đơn chứng từ kèm theo;\r\n	- Nhãn hàng hóa;\r\n	- Niêm yết giá.\r\n', '8h00-11h00', '- Giám đốc xuất trình Giấy chứng nhận đăng ký doanh nghiệp công ty TNHH hai thành viên trở lên số: 4100639069 đăng ký thay đổi lần thứ 5 ngày 29/8/2013 do Phòng Đăng ký kinh doanh Sở Kế hoạch và Đầu tư tỉnh Bình Định cấp.\r\n	- Hàng hóa đang kinh doanh tại công ty gồm: thép hộp mạ kẽm, thép V63, thép vuong mạ kẽm, thép không rỉ L3 SC304, thép không rỉ 304, tôn mạ màu, tôn mạ kẽm, thép không rỉ 201, thép hộp mạ kẽm Z8, ống Inox CN tròn, ống Inox sus 201, ống tròn Inox, ống vuông Inox, ống chữ nhật Inox các loại do Việt Nam sản xuất, có các hóa đơn GTGT( liên 2, bản chính) số: 0019157 ngày 03/5/2016; 0014240 ngày 22/4/2016; 0000007 ngày 06/4/2016; 0009358 ngày 01/4/2016, 0000415 ngày 15/4/2016, 0076522 ngày 11/5/2016, 0004292 ngày 09/4/2016\r\n	- Hàng hóa đang kinh doanh có nhãn hàng hóa đúng theo quy định, còn hạn sử dụng.\r\n	- Công ty thực hiện việc niêm yết giá hàng hóa theo đúng quy định bằng hình thức niêm yết giá bằng bảng mica treo công khai tại cocong ty và bảng đăng ký mức giá cụ thể.\r\n', 'Không vi phạm', NULL, '2016-06-22 15:36:01', 28, '2016-06-22 15:36:01', 28, NULL, NULL, 0, NULL, NULL),
(180, '2016-06-01 00:00:00', 'Phạm Thị Thu Hiền, Phan Thị Hồng Vân', 'Tổ trưởng, Kiểm soát viên', '- Giấy chứng nhận đăng ký kinh doanh; \r\n	- Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo;\r\n	- Nhãn hàng hóa;\r\n	- Niêm yết giá.\r\n', '8h00-10h00', '- Giấy chứng nhận đăng ký kinh doanh doanh nghiệp tư nhân số: 3501000111 đăng ký thay đổi lần thứ ba ngày 11/5/2005 do Phòng Đăng ký kinh doanh Sở kế hoạch và Đầu tư tỉnh Bình Định cấp.\r\n- Hàng hóa đang kinh doanh tại doanh nghiệp gồm: cầu dao tép, ống luồn dây mềm, công tắc, ổ cắm, máng điện, bộ ngắt mạch, quạt trần, quạt treo, máy nước nóng, quạt bàn đảo, quạt đứng, quạt lở, quạt treo, quạt lửng, đèn tường, đèn thả, đèn soi tranh, đèn chùa các loại, có các hóa đơn GTGT ( liên 2, bản chính) số: 0000956 ngày 19/3/2016, 0000550 ngày 22/10/2015, 0000128 ngày 01/6/2016, 0000599 ngày 19/5/2016, 0005794 ngày 29/01/2016, 0002803 ngày 28/5/2016, hóa đơn bán hàng ( liên 2, bản chính) số: 0073116 ngày 10/10/2015.\r\n- Mặt hàng đèn tường hiệu JUNSUN, ALXING, đèn soi tranh hiệu ORBIS do Trung Quốc sản xuất, có nhãn phụ không ghi tên, địa chỉ của tổ chức, cá nhân sản xuất. Cụ thể gồm:\r\n+ Đèn tường hiệu JUNSUN: số lượng 30 bộ, giá niêm yết 180.000 đồng/bộ\r\n+ Đèn tường hiệu ALXING: số lượng 50 bộ, giá niêm yết 250.000 đồng/bộ\r\n+ Đèn soi tranh hiệu ORBIS: số lượng 10 bộ, giá niêm yết 450.000 đồng/bộ\r\nTổng giá trị hàng hóa vi phạm: 22.400.000 đồng tính theo giá niêm yết tại doanh nghiệp.\r\nCác mặt hàng còn lại có nhãn hàng hóa đúng quy định.\r\n- Doanh nghiệp thực hiện niêm yết giá hàng hóa đúng quy định bằng hình thức niêm yết trực tiếp trên từng hàng hóa.\r\n', 'Phạt tiền: 1.500.000 đồng', NULL, '2016-06-22 16:11:11', 28, '2016-06-22 16:11:11', 28, NULL, NULL, 0, NULL, NULL),
(181, '2016-05-30 00:00:00', 'Nguyễn Văn Ngọc, Phạm Văn Hồng, ĐInh Minh Tiến', 'Tổ trưởng, Đội trưởng, Kiểm soát viên', '- Giấy chứng nhận đăng ký kinh doanh; \r\n	- Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo;\r\n	- Nhãn hàng hóa;\r\n	- Niêm yết giá.\r\n', '14h00-16h50', '-  Cơ sở có Giấy chứng nhận đăng ký kinh doanh hộ kinh doanh cá thể  số 35A8000882 do UBND TP Quy Nhơn cấp ngày 10/10/2008(bản chính)\r\n- Hàng hóa đang kinh doanh tại cửa hàng gồm:Đèn ngủ gắn tường, quạt tản nhiệt dùng cho máy vi tính, ổ cấm điện, đèn xạc điện, đèn ngủ, đèn ốp trần, đèn gắn nhà vệ sinh, đèn xạc điện xách tay. Hàng hóa có hóa đơn GTGT số: 0004493 ngày 27/5/2016, 0004418 ngày 26/5/2016, 0004473 ngày 27/5/2016 (liên 2 bản chính).\r\n- Tại thời điểm kiểm tra tổ kiểm tra phát hiện cửa hàng  đang kinh doanh mặt hàng : Đèn ngủ gắn tường loại 1 đui số lượng: 900 cái do Trung Quốc sản xuất (made in china) là hàng nhập khẩu có nhãn gốc bằng tiếng nước ngoài nhưng không có nhãn phụ bằng tiếng Việt Nam, đơn giá niêm yết 40.000 đồng/1 cái, giá trị vi phạm là 36.000.000 đồng  .\r\nCác mặt hàng còn lại có nhãn hàng hóa đúng quy định.\r\n- Cửa hàng thực hiện niêm yết giá hàng hóa đúng quy định(Hình thức  niêm yết trực tiếp trên sản phẩm).\r\n', 'Phạt tiền: 1.750.000 đồng', NULL, '2016-06-22 16:16:43', 28, '2016-06-22 16:16:43', 28, NULL, NULL, 0, NULL, NULL),
(182, '2016-05-30 00:00:00', 'Phạm Thị Thu Hiền, Phan Thị Hồng Vân', 'Tổ trưởng, Kiểm soát viên', '- Giấy chứng nhận đăng ký kinh doanh; \r\n	- Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo;\r\n	- Nhãn hàng hóa;\r\n	- Niêm yết giá.\r\n', '13h30-15h30', '- Giấy chứng nhận đăng ký kinh doanh hộ kinh doanh cá thể số: 35A8002271 đăng ký thay đổi lần thứ năm ngày 26/8/2015 do Phòng Tài chính –Kế hoạch UBND TP. Quy Nhơn cấp. \r\n- Hàng hóa đang kinh doanh tại cơ sở gồm: ấm đun nước siêu tốc Sunhan, bóng đèn led, đèn ốp trần 41-80 cm, đèn treo dây thả, đèn ngủ gắn tường, đèn gắn nhà vệ sinh các loại do nước ngoài sản xuất, có các hóa đơn GTGT ( liên 2, bản chính) số: 0000347 ngày 12/10/2015, 0000328 ngày 04/11/2015, 0000302 ngày 27/10/2015, hóa đơn bán hàng ( liên 2, bản chính) số: 0070686 ngày 08/01/2016.\r\n- Mặt hàng bóng đèn led, đèn ốp tràn 41-80 cm các loại, do Trung Quốc sản xuất, có nhãn gốc bằng tiếng nước ngoài nhưng không có nhãn phụ bằng tiếng Việt Nam. Cụ thể gồm:\r\n+ Bóng đèn led hiệu LED BULB: số lượng 100 chiếc, giá niêm yết 60.000 đồng/chiếc\r\n+ Bóng đèn led hiệu SASIMI: số lượng 60 chiếc, giá niêm yết 55.000 đồng/chiếc\r\n+ Bóng đèn led hiệu LED PANEL LIGHTS: số lượng 100 chiếc, giá niêm yết 60.000 đồng/chiếc\r\n+ Đèn ốp tràn 41-80 cm hiệu LED CEILING LAMP: số lượng 20 chiếc, giá niêm yết 250.000 đồng/chiếc\r\nTổng giá trị hàng hóa vi phạm: 20.300.000 đồng tính theo giá niêm yết tại cơ sở.\r\nCác mặt hàng còn lại có nhãn hàng hóa đúng quy định.\r\n- Cơ sở thực hiện niêm yết giá hàng hóa đúng quy định bằng hình thức niêm yết trực tiếp trên từng hàng hóa.\r\n', 'Phạt tiền: 750.000 đồng', NULL, '2016-06-23 10:14:02', 28, '2016-06-23 10:14:02', 28, NULL, NULL, 0, NULL, NULL),
(183, '2016-05-31 00:00:00', 'Nguyễn Văn Ngọc, ĐInh Minh Tiến', 'Tổ trưởng, Kiểm soát viên', '- Giấy chứng nhận đăng ký kinh doanh; \r\n	- Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo;\r\n	- Nhãn hàng hóa;\r\n	- Niêm yết giá.\r\n', '8h00-1030', '- Công ty có  Giấy chứng nhận đăng ký doanh nghiệp  số 4100467613 do sở Kế hoạch và Đầu tư Bình Định cấp và đăng ký thay đổi lần thứ 3 ngày 30/07/2012(bản chính)\r\n- Hàng hóa đang kinh doanh tại công ty gồm: Dây cáp điện, cầu dao điện . Hàng hóa có hóa đơn GTGT số: 0004956 ngày 06/04/2016, 0006931 ngày 12/05/2016, 0006932 ngày 12/05/2016 (liên 2 bản chính).\r\n- Tại thời điểm kiểm tra tổ kiểm tra phát hiện công ty đang kinh doanh mặt hàng : Dây cáp điện  có nhãn nhưng bị rách nát không đọc được hết nội dung trên nhãn hàng hóa gồm :\r\n  + Dây cáp điện ABC 4x25mm – 600V , số lượng : 230m, đơn giá:24.000đồng/1m , giá trị :5.520.000 đồng.\r\n  +  Dây cáp điện ABC 4x70mm – 600V, số lượng : 230m, đơn giá :61.000 đồng/1m , giá trị : 14.030.000 đồng.\r\n  +   Dây cáp điện CV95 mm – 600V, số lượng : 27m, đơn giá :137.000đồng/1m, giá trị : 3.699.000 đồng.\r\n  +  Tổng giá trị hàng hóa vi phạm: 23.249.000 đồng.\r\nCác mặt hàng còn lại có nhãn hàng hóa đúng quy định.\r\n- Công ty  thực hiện niêm yết giá hàng hóa đúng quy định(Hình thức có bản niêm yết giá tại nơi quy định).\r\n', 'Phạt tiền: 1.500.000 đồng', NULL, '2016-06-23 10:21:53', 28, '2016-06-23 10:21:53', 28, NULL, NULL, 0, NULL, NULL);
