(184, '2016-05-11 00:00:00', 'Nguyễn Văn Ngọc, ĐInh Minh Tiến', 'Tổ trưởng, Kiểm soát viên', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Giấy chứng nhận đủ điều kiện kinh doanh;\r\n- Giấy chứng nhận thực hành tốt nhà thuốc(GPP);\r\n- Giấy khám sức khỏe\r\n- Giấy chứng nhận tập huấn kiến thức\r\n	- Hàng hóa đang kinh doanh, hóa đơn chứng từ kèm theo;\r\n	- Nhãn hàng hóa;\r\n	- Niêm yết giá.\r\n', '11h10-13h20', '	- Giấy chứng nhận đăng ký kinh doanh  số:35A8011195 do UBND TP. Quy nhơn  cấp ngày 16/03/2013.\r\n          - Giấy chứng nhận đủ điều kiện kinh doanh thuôc số :64/YT-GCNKDT do sở y tế tỉnh Bình Định cấp ngày 29/03/2012 có giá trị đến ngày 39/03/2017.\r\n          - Giấy chứng nhận đạt nguyên tắc, tiêu chuẩn “thực hành tốt nhà thuốc” GPP số : 405/GPP do sở Y tế cấp ngày 25/06/2015 có giá trị đến ngày 25/6/2018.\r\n         - Giấy khám sức khỏe mang tên “ Lê Hoài Nam” do bệnh viện Đa khoa Hòa Bình cấp ngày 09/5/2016 đủ sức khỏe.\r\n        - Giấy xác nhận kiến thức về an toàn thực phẩm do Chi cục an toàn vệ sinh thực phẩm cấp cho Ông Lê Hoài Nam số: 775/2014/XNTH-ATVSTP cấp ngày 03/10/2014 có giá trị ba năm.\r\n   \r\n\r\n          - Hàng hóa đang kinh doanh tại Nhà thuốc gồm: Thuốc tây, thực phẩm chức năng các loại ,hàng hóa có hóa đơn GTGT bản chính, liên 2 số: 0006380 ngày 09/5/2016, 0037818 ngày 09/5/2016, số 0014447 ngày 04/5/2016, số 0008767 ngày 02/5/2016, số 0008788 ngày 03/5/2016, số 0008723 ngày 29/4/2016.\r\n	- Hàng hóa đang kinh doanh tại nhà thuốc có nhãn hàng hóa đúng quy định.\r\n	- Nhà thuốc  thực hiện việc niêm yết giá hàng hóa theo đúng quy định(hình thức niêm yết trực tiếp trên từng sản phẩm).\r\n', 'Không vi phạm', NULL, '2016-06-23 10:26:25', 28, '2016-06-23 10:26:25', 28, NULL, NULL, 0, NULL, NULL),
(185, '2016-06-14 00:00:00', 'Phạm Văn Hồng, Đinh Minh Tiến', 'Đội trưởng , Kiểm soát viên', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Hàng hóa đang kinh doanh, hóa đơn chứng từ kèm theo;\r\n- Nhãn hàng hóa;\r\n- Niêm yết giá.\r\n', '07g30-09g30 ngày 14/06/2016', '- Giấy chứng nhận đăng ký kinh doanh số : 35A8013153 đăng ký lần đầu ngày 24/10/2015 do UBND TP.Quy Nhơn.\r\n- Hàng hóa đang kinh doanh tại cửa hàng gồm: quần áo may sẳn các loại , hàng hóa có hóa đơn bán hàng kèm theo(lien 2 bản chính).\r\n- Hàng hóa đang kinh doanh có nhãn hàng hóa đúng quy định.\r\n- cửa hàng thực hiện niêm yết giá đúng quy định (niêm yết trực tiếp trên từng sản phẩm)', 'không vi phạm ', NULL, '2016-06-23 10:42:08', 28, '2016-06-23 10:42:08', 28, NULL, NULL, 0, NULL, NULL),
(186, '2016-06-02 00:00:00', 'Phạm Văn Hồng, Đinh Minh Tiến', 'Tổ trưởng, Kiểm soát viên', '- Giấy chứng nhận đăng ký kinh doanh; \r\n	- Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo;\r\n	- Nhãn hàng hóa;\r\n	- Niêm yết giá.\r\n', '10h00-11h00', 'Xuất trình:\r\n- Giấy chứng nhận đăng ký kinh doanh; \r\n	- Hàng hóa đang kinh doanh: nhôm, thép không gỉ, ống inox, hộp inox có hóa đơn chứng từ kèm theo;\r\n	- Nhãn hàng hóa: đúng quy định\r\nRiêng, ống inox sus 201: 284 cây có nhãn rách nát không đọc được hết các nội dung trên nhãn. Tổng giá trị vi phạm: 27.000.000 đồng\r\n	- Niêm yết giá: đúng quy định.', 'Phạt tiền: 1.500.000 đồng', NULL, '2016-06-23 10:42:24', 28, '2016-06-23 10:42:24', 28, NULL, NULL, 0, NULL, NULL),
(187, '2016-06-01 00:00:00', 'Phạm Văn Hồng, Đinh Minh Tiến', 'Tổ trưởng, Kiểm soát viên', '- Giấy chứng nhận đăng ký kinh doanh; \r\n	- Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo;\r\n	- Nhãn hàng hóa;\r\n	- Niêm yết giá.\r\n', '8h00-9h30', '- Giấy chứng nhận đăng ký kinh doanh; \r\n	- Hàng hóa đang kinh doanh: Thép V, thép phi tole, thép hộp mã kẽm có hóa đơn chứng từ kèm theo;\r\n	- Nhãn hàng hóa: đúng quy định\r\nRiêng mặt hàng thép V63 có nhãn không ghi đủ các nội dung bắt buộc. số lượng: 2.173kgx12.200 đồng/kg = 26.510.600 đồng\r\n	- Niêm yết giá: đúng quy định\r\n', 'Phạt tiền: 1.500.000 đồng', NULL, '2016-06-23 10:54:21', 28, '2016-06-23 10:54:21', 28, NULL, NULL, 0, NULL, NULL),
(188, '2016-06-03 00:00:00', 'Phạm Văn Hồng, Đinh Minh Tiến', 'Tổ trưởng, Kiểm soát viên', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Giấy chứng nhận đủ điều kiện kinh doanh xăng dầu, PCCC, ANTT;\r\n- Giấy chứng nhận huấn luyện nghiệp KD xăng dầu, PCCC, BVMT;\r\n- Giấy chứng nhận kiểm định phương tiện đo lường xăng dầu;\r\n	- Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo;\r\n	- Niêm yết giá;\r\n	- Niêm yết thời gian bán hàng.\r\n', '9h00-11h00', 'Có: - Giấy chứng nhận đăng ký kinh doanh; \r\n- Giấy chứng nhận đủ điều kiện kinh doanh xăng dầu, PCCC, ANTT;\r\n- Giấy chứng nhận huấn luyện nghiệp KD xăng dầu, PCCC, BVMT;\r\n- Giấy chứng nhận kiểm định phương tiện đo lường xăng dầu;\r\n	- Hàng hóa đang kinh doanh: xăng A92: 7.900 lít, xăng A95:7.700 lít, dầu hoả: 10.200 lít cóhóa đơn chứng từ kèm theo;\r\n	- Có Niêm yết giá;\r\n	- Có Niêm yết thời gian bán hàng.\r\n', 'Không vi phạm', NULL, '2016-06-23 11:02:21', 28, '2016-06-23 11:02:21', 28, NULL, NULL, 0, NULL, NULL),
(189, '2016-06-14 00:00:00', 'Phạm Văn Hồng, Nguyễn Văn Ngọc,  Đinh Minh Tiến ', 'Đội trưởng , P.Đội trưởng, Kiểm soát viên', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Hàng hóa đang kinh doanh, hóa đơn chứng từ kèm theo;\r\n- Nhãn hàng hóa;\r\n- Niêm yết giá.\r\n', '10g-11g ngày 14/06/2016', '- Giấy chứng nhận đăng ký kinh doanh số 35A8012300 do UBND TP. Quy Nhơn cấp ngày 24/06/2014.\r\n- Hàng hóa đang kinh doanh tại cửa hàng gồm: Quần áo may sẳn các loại, hàng hóa có hóa đơn bán hàng kèm theo.\r\n- Hàng hóa đang kinh doanh tại cửa hàng có nhãn đúng quy định.\r\n- Cửa hàng thực hiện niêm yết giá đúng quy định.\r\n', 'không vi phạm ', NULL, '2016-06-23 11:08:13', 28, '2016-06-23 11:08:13', 28, NULL, NULL, 0, NULL, NULL),
(190, '2016-05-27 00:00:00', 'Phạm Văn Hồng, Phạm Thị Thu Hiền', 'Tổ trưởng, Phó Đội trưởng', '- Giấy chứng nhận đăng ký kinh doanh; \r\n	- Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo;\r\n	- Nhãn hàng hóa;\r\n	- Niêm yết giá.\r\n', '8h00-11h00', '- Có Giấy chứng nhận đăng ký kinh doanh; \r\n	- Hàng hóa đang kinh doanh: thép lá, thép V40, thép lập lo, thép ống mạ, thép hộp kẽm, ống tròn, vuông, chữ nhật  inox, thep không gỉ 304 do VN sản xuất có hóa đơn chứng từ kèm theo;\r\n	- Nhãn hàng hóa; đúng quyd dịnh \r\nTiêng mặt hàng thép không gỉ 304: 250kg có nhãn không ghi đủ các nội dung bắt buộc trên hãnh hàng hoá. hàng hoá vi phạm có giá trị: 15.500.000 đồng\r\n	- Niêm yết giá: đúng quy định.', 'Phạt tiền: 750.000 đồng', NULL, '2016-06-23 11:08:32', 28, '2016-06-23 11:08:32', 28, NULL, NULL, 0, NULL, NULL),
(191, '2016-06-09 00:00:00', 'Nguyễn Văn Ngọc, Đinh Minh Tiến ', 'Tổ trưởng, Kiểm soát viên thị trường ', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo;\r\n- Nhãn hàng hóa;\r\n- Niêm yết giá.\r\n', '15g-16g30', '- Giấy chứng nhận đăng ký kinh doanh số 4101401171 do sở KH-ĐT cấp ngày 01/09/2015.\r\n- Hàng hóa đang kinh doanh tại công ty gồm :ổ cứng, mực in, camera, đầu ghi hình,...hàng hóa có hóa đơn GTGT kèm theo.\r\n- Công ty thực hiện việc niêm yết giá đúng theo quy định.\r\n', 'không vi phạm ', NULL, '2016-06-23 14:31:32', 28, '2016-06-23 14:31:32', 28, NULL, NULL, 0, NULL, NULL),
(192, '2016-06-09 00:00:00', 'Phạm Văn Hồng, Phạm Thị Thu Hiền', 'Tổ trưởng ,P.Đội trưởng ', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo;\r\n- Nhãn hàng hóa;\r\n- Niêm yết giá.\r\n', '14g-16g30', '- Giấy chứng nhận đăng ký kinh doanh số 35A8013635 do UBND TP Quy Nhơn cấp ngày 31/05/2016.\r\n- Hàng hóa đang kinh doanh tại cửa hàng gồm: Quần áo may sẳn các loại . Hàng hóa có hóa đơn bán hàng kèm theo.\r\n- hàng hóa tại cửa hàng có nhãn đúng quy định.\r\n- Cửa hàng thực hiện niêm yết giá đúng quy định.', 'không vi phạm ', NULL, '2016-06-23 14:53:32', 28, '2016-06-23 14:53:32', 28, NULL, NULL, 0, NULL, NULL),
(193, '2016-06-01 00:00:00', 'Phạm Văn Hồng, Đinh Minh Tiến', 'Tổ trưởng, Kiểm soát viên', '- Giấy chứng nhận đăng ký kinh doanh; \r\n	- Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo;\r\n	- Nhãn hàng hóa;\r\n	- Niêm yết giá.\r\n', '10h00-11h30', '- Giấy chứng nhận đăng ký kinh doanh; \r\n	- Hàng hóa đang kinh doanh: ống nước, bồn inox, ống thép mạ kẽm có hóa đơn chứng từ kèm theo;\r\n	- Nhãn hàng hóa: đúng quy định;\r\n	- Niêm yết giá: đúng quy định.', 'Không vi phạm', NULL, '2016-06-23 15:06:05', 28, '2016-06-23 15:06:05', 28, NULL, NULL, 0, NULL, NULL),
(194, '2016-06-07 00:00:00', 'Nguyễn Văn Ngọc, Phạm Văn Hồng , Phạm Thị Thu Hiền', 'Tổ trưởng, Đội trưởng ,P.Đội trưởng ', 'Hàng hóa đang kinh doanh là thuốc lá điếu ngoại nhập và hóa đơn chứng từ kèm theo.', '10g30-11g ngày 07/06/2016', 'Tại thời điểm kiểm tra tổ kiểm tra phát hiện cửa hàng tạp hóa \" Gia Hân \" do bà Phan Thị Thu Hồng làm chủ hộ kinh doanh đang bày bán mặt hàng thuốc lá điếu ngoại nhập không có hóa đơn , không có tem nhập khẩu.\r\n1. Thuốc lá điếu hiệu Esse , số lượng 12 bao \r\n2. Thuốc lá điếu hiệu Richmond , số lượng 02 bao.', 'PT:1.500.000 đồng, tịch thu toàn bộ thuốc lá điếu ngoại nhập', NULL, '2016-06-23 15:24:03', 28, '2016-06-23 15:24:03', 28, NULL, NULL, 0, NULL, NULL),
(195, '2016-05-31 00:00:00', 'Phạm Thị Thu Hiền, Phan Thị Hồng Vân', 'Tổ trưởng, Kiểm soát viên', '- Giấy chứng nhận đăng ký kinh doanh; \r\n	- Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo;\r\n	- Nhãn hàng hóa;\r\n	- Niêm yết giá.\r\n', '8h00-11h00', '- Giấy chứng nhận đăng ký kinh doanh hộ kinh doanh số: 00846/HKD ngày 12/01/2001 do UBND TP Quy Nhơn, tỉnh Bình Định cấp.\r\n- Hàng hóa đang kinh doanh tại doanh nghiệp gồm: quần jean nam, quần soox nam, áo sơ mi nam các laoij do VN sản xuất có các hoá đơn bán hàng số 0057804 ngày 07/01/2015, 0079183 ngày 17/12/2015, 0085974 ngày 7/11/2012.\r\nTại thời điểm kiểm tra, mặt hàng quần jean nam hiệu Lexus, glamour jean có nhãn không ghi tên, địa chỉ của tổ chức, cá nhân chịu trách nhiệm về hàng hoá. Cụ thể gồm:\r\n+ quần jean nam hiệu Lexus: số lượng 30 chiếc, giá niêm yết 565.000 đồng/chiếc\r\n+ quần jean nam hiệu glamour jean: số lượng 20 chiếc, giá niêm yết 435.000 đồng/chiếc\r\nTổng giá trị hàng hóa vi phạm: 25.650.000 đồng tính theo giá niêm yết tại doanh nghiệp.\r\nCác mặt hàng còn lại có nhãn hàng hóa đúng quy định.\r\n- Công ty thực hiện niêm yết giá hàng hóa đúng quy định bằng hình thức niêm yết trực tiếp trên từng hàng hóa.\r\n', 'Phạt tiền: 750.000 đồng', NULL, '2016-06-24 10:29:36', 28, '2016-06-24 10:29:36', 28, NULL, NULL, 0, NULL, NULL),
(196, '2016-06-02 00:00:00', 'Phạm Thị Thu Hiền, Phan Thị Hồng Vân', 'Tổ trưởng, Kiểm soát viên', '- Giấy chứng nhận đăng ký kinh doanh; \r\n	- Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo;\r\n	- Nhãn hàng hóa;\r\n	- Niêm yết giá.\r\n', '11h05-12h00', '- Giấy chứng nhận đăng ký doanh nghiệp Công ty TNHH hai thành viên trở lên số: 4101453797 đăng ký thay đổi lần thứ nhất ngày 08/12/2015 do Phòng Đăng ký kinh doanh Sở kế hoạch và Đầu tư tỉnh Bình Định cấp.\r\n- Hàng hóa đang kinh doanh tại doanh nghiệp gồm: cầu dao điện, máng đèn âm trần, máng điện, ống luồn dây điện, công tắc, cầu chỉ, ổ cắm ăng ten, đèn dowlight led ba màu, bong led tube, bong đền halogen, chao đèn, đèn chum, đèn cây, đèn soi gương, quạt đèn, đèn gắn nổi choá phản quang 1x36w, đèn âm trần choá phản quang 2x36w các loại có hoá đơn GTGT kèm theo gồm: 0000399 ngày 22/4/2016, 0002106 ngày 4/5/2016, 0001490 ngày 21/4/2016, số 0001467 ngày 14/4/2016, 0001459 ngày 12/4/2016, 0005700 ngày 8/4/2016, 0000114 ngày 18/5/2016.\r\nTại thời điểm kiểm tra, đèn gắn nổi choá phản quang 1x36w, đèn âm trần choá phản quang 2x36w hiệu Duhal do Việt Nam sản xuất, có nhãn không ghi tên, địa chỉ của tổ chức, cá nhân chịu trách nhiệm về hàng hoá. Cụ thể gồm:\r\n+ Đèn gắn nổi choá phản quang 1x36w hiệu Duhal: số lượng 25 cái, giá niêm yết 500.000 đồng/cái\r\n+ Đèn âm trần choá phản quang 2x36w hiệu Duhal: số lượng 17 cái, giá niêm yết 500.000 đồng/cái\r\nTổng giá trị hàng hóa vi phạm: 21.000.000 đồng tính theo giá niêm yết tại doanh nghiệp.\r\nCác mặt hàng còn lại có nhãn hàng hóa đúng quy định.\r\n- Công ty thực hiện niêm yết giá hàng hóa đúng quy định bằng hình thức niêm yết trực tiếp trên từng hàng hóa.\r\n', 'Phạt tiền:1.500.000 đồng', NULL, '2016-06-24 10:31:40', 28, '2016-06-24 10:31:40', 28, NULL, NULL, 0, NULL, NULL),
(197, '2016-05-30 00:00:00', 'Phạm Thị Thu Hiền, Phan Thị Hồng Vân', 'Tổ trưởng, Kiểm soát viên', '- Giấy chứng nhận đăng ký kinh doanh; \r\n	- Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo;\r\n	- Nhãn hàng hóa;\r\n	- Niêm yết giá.\r\n', '15h45-17h00', '- Giấy chứng nhận đăng ký kinh doanh; \r\n	- Hàng hóa đang kinh doanh: loa, âm ly, tivi, máy tăng âm, màn hình cảm ứng có hóa đơn chứng từ kèm theo;\r\n	- Nhãn hàng hóa: đúng quy định;\r\n	- Niêm yết giá: đúng quy định.\r\n', 'Không vi phạm', NULL, '2016-06-24 10:40:28', 28, '2016-06-24 10:40:28', 28, NULL, NULL, 0, NULL, NULL),
(198, '2016-06-02 00:00:00', 'Phạm Thị Thu Hiền, Phan Thị Hồng Vân', 'Tổ trưởng, Kiểm soát viên', '- Giấy chứng nhận đăng ký kinh doanh; \r\n	- Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo;\r\n	- Nhãn hàng hóa;\r\n	- Niêm yết giá.\r\n', '9h15-11h00', '- Giấy chứng nhận đăng ký doanh nghiệp hộ kinh doanh cá thể cấp đăng ký thay đổi lần thứ 2 ngày 30/05/2012.\r\n	- Hàng hóa đang kinh doanh tại cơ sở: bong đèn điện quang, compact điện quang, bộ ngắt mạch an toàn, cầu chì, cầu dao tép, công tắc, ổ cắm, ống luồn dây mềm, công tắc từ, cầu dao diện, role nhiệt các loại có hoá đơn GTGT số 0001194 ngày 28/5/2016, số 0000130 ngày 01/6/2016, số 0003161 ngày 10/5/2016, số 0001563 ngày 22/01/2015.\r\n	- Hàng hóa đang kinh doanh có nhãn hàng hóa đúng theo quy định.\r\n	- Công ty có thực hiện việc niêm yết giá hàng hóa theo đúng quy (niêm yết trực tiếp trên từng sản phẩm).\r\n', 'Không vi phạm', NULL, '2016-06-24 10:41:45', 28, '2016-06-24 10:41:45', 28, NULL, NULL, 0, NULL, NULL),
(199, '2016-06-02 00:00:00', 'Phạm Thị Thu Hiền, Phan Thị Hồng Vân', 'Tổ trưởng, Kiểm soát viên', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Giấy chứng nhận đủ điều kiện kinh doanh LPG, PCCC, ANTT;\r\n- Giấy chứng nhận huấn luyện nghiệp KDLPG, PCCC, BVMT, ĐLCL\r\n	- Hàng hóa đang kinh doanh, hợp đồng mua bán và hóa đơn chứng từ kèm theo;\r\n	- Nhãn hàng hóa;\r\n	- Niêm yết giá.\r\n', '9h00-11h30', '- Giấy chứng nhận đăng ký doanh nghiệp công ty TNHH hai thành viên số: 4100428438 do Sở kế hoạch và Đầu tư Bình Định cấp đăng ký thay đổi lần thứ 5 ngày 01/03/2012.\r\n	- Giấy chứng nhận đủ điều kiện kinh doanh khí dầu mở hoá lỏng số 57/GCNLPG – SCT ngày 28/9/2015 do Sở Công thương tỉnh Bình Định cấp, có giá trị đến hết ngày 27/9/2010;\r\n	- Giấy chứng nhận Phòng cháy chữa cháy số 399/Đk – PCCC ngày 29/5/2007 do Phòng CSGT Công an tỉnh cấp;\r\n	- Giấy chứng nhận đủ điều kiện về ANTT để làm ngành nghề kinhd oanh số 663/GCN ngày 14/01/2015 do CA TP Quy Nhơn cấp\r\n	- Giấy chứng nhận huấn luyện nghiệp vụ PCCC số 0041273 ngày 30/6/2014 mang tên Nguyễn Cảnh và số 0041272 ngày 30/6/2014 mang tên Phan Thanh Bình;\r\n	- Giấy chứng nhận tham dự lớp bồi dưỡng huấn luyện NVKD-ĐLCL-ATLĐ-VSMT số 74123 ngày 28/7/2010 mang tên Nguyễn Cảnh và số 74141 ngày 28/7/2010 mang tên Phan Thanh Bình do Trường Cao đẳng thương mại cấp;\r\n	- Hàng hóa đang kinh doanh tại công ty gồm: LPG hiệu Petronas: loại 12kg: 38 bình; loại 45kg: 02 bình; LPG Hiệu Vgas: loại 12kg: 02 bình; hagf háo đang kinh doanh dó hoá đơn GTGT số 0003385 ngày 27/5/2016, 0003387 ngày 28/5/2016, số 0003388 ngày 28/5/2016, 0003389 ngày 30/5/2016, 0003390 ngày 30/5/2016, 0003391 ngày 31/5/2016.\r\n	- Hợp đồng mua bán số 01/2013/HĐMB ngày 26/8/2013 \r\n 	- Hàng hóa đang kinh doanh có nhãn hàng hóa đúng theo quy định.\r\n	- Công ty có thực hiện việc niêm yết giá hàng hóa theo đúng quy (có bảng kê khai giá và niêm yết giá).\r\n', 'Không vi phạm', NULL, '2016-06-24 10:49:14', 28, '2016-06-24 10:49:14', 28, NULL, NULL, 0, NULL, NULL)