(200, '2016-06-07 00:00:00', 'Nguyễn Văn Ngọc, Phạm Văn Hồng , Phạm Thị Thu Hiền', 'Tổ trưởng;Đội trưởng; Phó Đội trưởng', 'Mặt hàng thuốc lá điếu đang kinh doanh và hoá đơn chứng từ kèm theo.', '9g30-10g ngày 07/06/2016', 'Tại thời điểm kiểm tra tổ kiểm tra phát hiện cửa hàng tạp hoá Hồng Hạnh do bà Ngô Thị Hồng làm chủ hộ đang bày bán mặt hàng thuốc lá ngoại nhập lậu không có hoá đơn chứng từ , không có tem nhập khẩu gồm:\r\n1. thuốc lá điếu hiệu Hero , số lượng : 15 bao \r\n2. thuốc lá điếu hiệu 555 ,số lượng 04 bao \r\n3. thuốc lá điếu hiệu Capri, số lượng :03 bao \r\n4. thuốc lá điếu hiệu Esse Menthol , số lượng 14 bao \r\n5. . thuốc lá điếu hiệu Esse classic , số lượng : 06 bao \r\n', 'PT :3.500.000 đồng , tịch thu toàn bộ số thuốc lá vi phạm ', NULL, '2016-06-24 15:13:49', 28, '2016-06-24 15:13:49', 28, NULL, NULL, 0, NULL, NULL),
(201, '2016-06-23 00:00:00', 'Đặng Thị Lệ Vân, Nguyễn Ngọc Anh', 'Tổ trưởng, KSV TC', '- Giấy chứng nhận đăng ký kinh doanh;\r\n- Giấy chứng nhận đủ điều kiện kinh doanh LPG;\r\n- Giấy chứng nhận nghiệp vụ kinh doanh LPG;\r\n- Giấy chứng nhận đủ điều kiện về PCCC;\r\n- Hợp đồng đại lý ;\r\n- Hàng hóa đang kinh doanh, hóa đơn kèm theo;\r\n- Nhãn hàng hóa;\r\n- Niêm yết giá.', 'Từ 09 giờ 00\' đến 10 giờ 30\'', '- Giấy chứng nhận đăng ký hộ kinh doanh số: 35J8000542 do Phòng tài chính kế hoạch huyện Tuy Phước cấp ngày 27.04.2012\r\n- Giấy chứng nhận đủ điều kiện kinh doanh khí dầu mỏ hóa lỏng số: 07/GCNLPG-SCT do Sở Công thương cấp có giá trị đến ngày 24/07/2016;\r\n- 02 Giấy chứng nhận nghiệp vụ kinh doanh LPG số: 69665 và số: 77857 do trường Cao đẳng thương mại cấp ngày 23.07.2005 và ngày 22.03.2012;\r\n- Giấy chứng nhận dủ điều kiện về PCCC số: 445/ĐK. PCCC do công an Bình Định cấp ngày 13.12.2007;\r\n- Hợp đồng đại lý mua bán LPG số: 36/HĐĐL/2015 và hợp ddoongf kinh tế số: 36/HĐĐL.NT -2015 đối với công ty TNHH Nhật Tiến ký ngày 10.07.2015 có hiệu lực đến ngày 10.07.2020;\r\n- Hàng hóa đang kinh doanh khí dầu mỏ hóa lỏng loại bình 12kg mang nhãn hiệu: VT, GAS, NHATTIEN GAS . Có hóa đơn GTGT số: 0000318;\r\n- Hàng hóa có niêm màng co đúng nhãn hiệu và ghi nhãn hàng hóa đúng theo quy định của pháp luật;\r\n- Tại cơ sở có niêm yết giá hàng hóa đúng quy định.', '- Không vi phạm', NULL, '2016-06-29 09:27:51', 27, '2016-06-29 09:27:51', 27, NULL, NULL, 0, NULL, NULL),
(202, '2016-06-28 00:00:00', 'Trương Duy Chương, Nguyễn Văn Huấn, Phạm Thiện Hùng, Lê Xuân Dương', 'Tổ trưởng, Kiểm soát viên', 'Về việc ghi nhãn hàng hóa đang kinh doanh tại Cửa hàng Thanh Nghiêm - Năng An, Ân Tín, Hoài Ân', '08h15 - 09h45', 'Kinh doanh hàng hóa có nhãn nhưng bị mờ không đọc được hết các nội dung trên nhãn hàng hóa. Tổng trị giá hàng hóa vi phạm 21.375.000 đồng.', 'Phạt tiền 750.000 đồng', NULL, '2016-06-30 14:02:39', 29, '2016-06-30 14:02:39', 29, NULL, NULL, 0, NULL, NULL),
(203, '2016-06-21 00:00:00', 'Nguyễn Văn Ngọc, Đinh Minh Tiến, Phan Thị Hồng Vân ', 'Tổ trưởng, Kiểm soát viên thị trường, Kiểm soát viên thị trường', '- Giấy chứng nhận đăng kí kinh doanh \r\n- hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo\r\n- Nhãn hàng hóa\r\n- niêm yết giá ', '14g30-15g30', '- Giấy chứng nhận đăng kí kinh doanh số 35A8011011, ngày 18/10/2011 do UBND TP.Quy Nhơn cấp.\r\n- hàng hóa đang kinh doanh tại cửa hàng gồm quần áo may sẳn các loại , hàng hóa có hóa đơn chứng từ kèm theo.\r\n- Hàng hóa do Việt Nam sản xuất , có nhãn đúng quy định.\r\n- Cửa hàng thực hiện niêm yết giá đúng quy định.', 'không vi phạm', NULL, '2016-07-01 09:04:14', 28, '2016-07-01 09:04:14', 28, NULL, NULL, 0, NULL, NULL),
(204, '2016-06-28 00:00:00', 'Phạm Thị Thu Hiền, Phan Thị Hồng Vân ', 'Tổ trưởng, Kiểm soát viên thị trường', '-Giấy chứng nhận đăng kí kinh doanh \r\n-Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo\r\n-Nhãn hàng hóa\r\n-Niêm yết giá ', '14g-16g30', '-Giấy chứng nhận đăng kí kinh doanh số 35A8013703, ngày 24/06/2016 .\r\n-Hàng hóa đang kinh doanh tại cửa hàng gồm: quần áo may sẳn các loại do Việt Nam sản xuất , có hóa đơn chứng từ kèm theo.\r\n- Hàng hóa tại cửa hàng có nhãn hàng hóa đúng quy định.\r\n-cửa hàng thực hiện Niêm yết giá  đúng quy định ', 'không vi phạm ', NULL, '2016-07-01 09:55:24', 28, '2016-07-01 09:55:24', 28, NULL, NULL, 0, NULL, NULL),
(205, '2016-04-27 00:00:00', 'Phạm Thị Thu Hiền, Đinh Minh Tiến, Phan Thị Hồng vân ', 'Tổ trưởng, Kiểm soát viên thị trường,Kiểm soát viên thị trường ', 'Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo', '13h30-17h', '- Chủ hộ kinh doanh có xuất trình giấy chứng nhận đăng ký kinh doanh hộ kinh doanh cá thể số 35A8000063 do UBND TP. Quy Nhơn cấp đăng ký thay đổi lần thứ hai ngày 11/10/2007 (bản chính).\r\n- Hàng hóa đang kinh doanh tại cơ sở: qua kiểm tra tổ kiểm tra phát hiện cơ sở đang kinh doanh một số mặt hàng túi xách, ví cầm tay các loại do nước ngoài sản xuất (made in China) không có hóa đơn chứng từ, không có nhãn phụ chứng minh tính hợp pháp của hàng hóa, gồm:\r\nTúi xách hiệu Ferragarrra 201615: 20 chiếc, giá niêm yết 315.000 đồng/chiếc.\r\nVí cầm tay 1509: 20 chiếc, giá niêm yết 95.000 đồng/chiếc\r\nVí cầm tay 1565: 20 chiếc, giá niêm yết 95.000 đồng/chiếc\r\nVí cầm tay hiệu GLORIOUSD 1563: 20 chiếc, giá niêm yết 95.000 đồng/chiếc\r\nVí cầm tay 1561: 20 chiếc, giá niêm yết 95.000 đồng/chiếc\r\nVí cầm tay 1560: 20 chiếc, giá niêm yết 55.000 đồng/chiếc\r\nVí cầm tay hiệu GLORIOUSD 1564: 19 chiếc, giá niêm yết 55.000 đồng/chiếc\r\nVí cầm tay 1562: 20 chiếc, giá niêm yết 55.000 đồng/chiếc\r\nTổng số lượng: 159 chiếc. Tổng giá trị hàng hóa vi phạm: 17.145.000 đồng tính theo giá niêm yết tại cơ sở.\r\n- Cơ sở thực hiện niêm yết giá đúng quy định.\r\n', 'PT: 4.000.000 đồng ', NULL, '2016-07-08 08:13:40', 28, '2016-07-08 08:13:40', 28, NULL, NULL, 0, NULL, NULL),
