(224, '2016-06-03 00:00:00', 'Phạm Thị Thu Hiền, Đinh Minh Tiến', 'Tổ trưởng, Kiểm soát viên thị trường ', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Giấy chứng nhận đủ điều kiện kinh doanh xăng dầu, PCCC, ANTT;\r\n- Giấy chứng nhận huấn luyện nghiệp KD xăng dầu, PCCC, BVMT;\r\n- Giấy chứng nhận kiểm định phương tiện đo lường xăng dầu;\r\n	- Hàng hóa đang kinh doanh, hợp đồng mua bán và hóa đơn chứng từ kèm theo;\r\n	- Niêm yết giá;\r\n	- Niêm yết thời gian bán hàng.\r\n', '14h-17h', 'Thực hiện Quyết định kiểm tra việc chấp hành pháp luật số: 005506/QĐ-KT ngày 03/6/2016 của Đội trưởng Đội Quản lý thị trường số 7. Vào lúc 14 giờ 00 ngày 03/6/2016, Tổ kiểm tra tiến hành kiểm tra đối với Cửa hàng xăng dầu Ngọc Sương – Công ty TNHH TM Tổng hợp Thành Ân 2. Địa chỉ: Tổ 5 KV 1, phường Trần Quang Diệu, TP. Quy Nhơn, tỉnh Bình Định.\r\n Nội dung kiểm tra như tại biên bản kiểm tra việc chấp hành pháp luật số 002520/BB-KT ngày 03/6/2016 của Đội QLTT số 7. Kết quả như sau:\r\n	- Chủ cơ sở xuất trình Giấy chứng nhận đăng ký doanh nghiệp số 4100236165 đăng ký lần thứ 7 ngày 04/12/2015 do Sở KH & ĐT BÌnh Định cấp; \r\n	- giấy chứng nhận đăng ký địa điểm kinh doanh mã số 00004 cấp ngày 04/12/2015; \r\n	- giấy chứng nhận đủ điều kiện về PCCC số 61 ngày 27/12/2007 do CA tỉnh Cấp; \r\n	- giấy chứng nhận đủ điều kiện kinh doanh xăng dầu số 65 ngày 13/11/2012, có giá trị đến hết ngày 18/11/2017; \r\n	- giấy chứng nhận huấn luận PCCC số 023755 ngày 13/11/2001, 013462 ngày 26/12/1998, 0350731 ngày 01/12/2015, 0041587 ngày 01/10/2014; giấy chứng nhận nghiệp vụ bảo vệ môi trường số 84417 ngày 23/10/2015, 84471 ngày 23/10/2015, 84311 ngày 23/10/2015, 79865 ngày 6/6/2013.\r\n	- Giấy chứng nhận kiểm định cột đo xăng, dầu: 0657, 06581, 0659, 0660, 0661, 0662 ngày 5/12/2015; giấy chứng nhận kiểm định bình đong 366, 367, 368, 370 ngày 29/10/2015 và 18/8/2015.\r\n	- Hàng hóa đang kinh doanh gồm: Dâu Do 0,05%: 41.296 lít, xăng A92: 9.945,5 lít. Cửa hàng không kinhd oanh mặt hàng dầu hỏa.\r\n	Hàng hóa có hợp đồng đại lý số 01 ngày 01/12/2015 và các Hóa đơn GTGT số: 0004149 ngày 02/6/2016, 0004150 ngày 02/6/2016, 0004035 ngày 10/5/2016, 0009261 ngày 18/5/2016.\r\n	- Cơ sở thực hiện việc niêm yết giá hàng hóa theo đúng quy định có niêm yết thời gian bán hàng.\r\n', 'Không vi phạm ', NULL, '2016-07-15 16:02:49', 28, '2016-07-15 16:02:49', 28, NULL, NULL, 0, NULL, NULL),
