(227, '2016-07-14 00:00:00', 'Phạm Văn Hồng, Nguyễn Văn Ngọc , Phạm Thị Thu Hiền, Đinh Minh Tiến, Phan Thị Hồng Vân ', 'Tổ trưởng, P.Đội trưởng, , P.Đội trưởng ,Kiểm soát viên thị trường, kiểm soát viên thị trường ', 'Khám 07 chiếc xe đạp điện đã qua sử dụng', '02h-07h20', '	Kết quả khám: \r\nTại lề đường QL1D – đối diện trước chành nhận hàng 6 đông -  P. Ghềnh ráng, TP. Quy Nhơn, tỉnh Bình Định có 07 chiếc xe đạp ngoài nhập đã qua sử dụng không có chủ nhận, không có hóa đơn chứng từ gồm:\r\n	1/. Xe đạp đã qua sử dụng hiệu Eco – city B7K4310 màu xám ( không có: ba ga sau, giỏ trước) số lượng 01 chiếc.\r\n	2/. Xe đạp đã qua sử dụng hiệu GIOS YL6K0162 màu đỏ ( không có: ba ga sau, giỏ trước, yên) số lượng 01 chiếc.\r\n	3/. Xe đạp đã qua sử dụng hiệu SHALLESS YAS8I07637 màu xám          ( không có: ba ga sau, giỏ trước) số lượng 01 chiếc.\r\n	4/. Xe đạp đã qua sử dụng hiệu CHEVAUX AS10120133 màu trắng         ( không có: ba ga sau, giỏ trước, yên) số lượng 01 chiếc.\r\n	5/. Xe đạp đã qua sử dụng hiệu CHEVAUX AS70120670 màu trắng         ( không có: ba ga sau, giỏ trước, gạc sau, gạc trước) số lượng 01 chiếc.\r\n	6/. Xe đạp đã qua sử dụng không hiệu C400100402 màu xám (không có: ba ga sau, giỏ trước) số lượng 01 chiếc.\r\n	7/. Xe đạp đã qua sử dụng hiệu TACCHINO 5H005860 màu trắng (không có: ba ga sau, giỏ trước) số lượng 01 chiếc.\r\n	Đội Quản lý thị trường số 7 đã tạm giữ toàn bộ số hàng hóa trên để xử lý theo quy định của pháp luật.\r\n', 'Tạm giữ 07 chiếc xe đạp điện đã qua sử dụng ', NULL, '2016-07-26 15:50:04', 28, '2016-07-26 15:50:04', 28, NULL, NULL, 0, NULL, NULL),
