(229, '2016-04-20 00:00:00', 'Vũ Minh Kiên', 'Tổ trưởng', 'Giấy chứng nhận ĐKKD\r\nHàng hóa đang kinh doanh\r\nNhãn hàng hóa\r\nNiêm yết giá và bán theo giá niêm yết', '08 giờ 10 đến 10 giờ 40', 'Giấy chứng nhận ĐKKD số 35F8000324 cấp ngày 24/12/2003\r\nHàng hóa: VLXD các loại\r\nMặt hàng tấm lợp, Tôn viproxi mang vi phạm nhãn (Không ghi tên hàng hóa), trị giá 26.700.000đ', 'Phạt tiền: 750.000đ', NULL, '2016-08-11 14:58:21', 30, '2016-08-11 14:58:21', 30, NULL, NULL, 0, NULL, NULL),
(230, '2016-05-05 00:00:00', 'Vũ Minh Kiên', 'Tổ trưởng', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Hàng hóa đang kinh doanh và hóa đơn kèm theo;\r\n- Nhãn hàng hóa;\r\n- Niêm yết giá và bán theo giá niêm yết.\r\n', '08 giờ 10 đến 10 giờ 40', 'Tại thời điểm kiểm tra:\r\n+ Giấy chứng nhận đăng hộ kinh doanh số 35F8000680 do Phòng TC-KH huyện Vĩnh Thạnh cấp ngày 24/8/2010.\r\n	+ Hàng hóa đang kinh doanh gồm: Sơn hiệu Dulux, sơn hiệu Kova, sơn hiệu Maxilite, sơn hiệu XO, bồ inox hiệu Sơn Hà, xi măng Vixem, sắt cuộn JPS (phi 6,8) sắt cây ATM (phi 10,12,14), tôn kẽm hiệu Hoa Sen. Các mặt hàng trên do Việt Nam sản xuất có hóa đơn chứng từ kèm theo.\r\n+ Nhãn hàng hóa: Các mặt hàng sơn, bồn inox, xi măng, tôn kẽm có nhãn hàng hóa ghi đúng theo quy định của pháp luật về nhãn hàng hóa.\r\n+ Riêng mặt hàng sắt cuộn JPS (phi 6,8) sắt cây ATM (phi 10,12,14) theo quy định phải có nhãn hàng hóa nhưng không ghi nhãn hàng hóa.\r\n+ Cửa hàng thực hiện niêm yết giá bán hàng hóa trên từng sản phẩm đúng theo quy định.\r\n* Hành vi vi phạm hành chính: Kinh doanh hàng hóa theo quy định phải có nhãn nhưng không ghi nhãn hàng hóa. Hàng hóa vi phạm có giá trị: 11.112.000 đồng.\r\n', 'Hình thức xử phạt chính: \r\n* Phạt tiền: 375.000 đồng theo quy định tại Khoản 2 Điều 3 và điểm b Khoản 2 Điều 25 Nghị định số 80/2013/NĐ-CP ngày 19/7/2013 của Chính phủ.\r\n* Biện pháp khắc phục hậu quả: Buộc thu hồi hàng hóa vi phạm về nhãn hàng hóa theo quy định tại điểm a Khoản 7 Điều 26 Nghị định số 80/2013/NĐ-CP ngày 19/7/2013 của Chính phủ.\r\n', NULL, '2016-08-11 15:02:26', 30, '2016-08-11 15:02:26', 30, NULL, NULL, 0, NULL, NULL),
(231, '2016-05-10 00:00:00', 'Nguyễn Văn Tú', 'Tổ trưởng', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Hàng hóa đang kinh doanh và hóa đơn kèm theo;\r\n- Nhãn hàng hóa;\r\n- Niêm yết giá và bán theo giá niêm yết.\r\n', '08 giờ 15 đến 10 giờ 20', 'Giấy chứng nhận ĐKKD số 35F800754 do UBND huyện Vĩnh Thạnh cấp ngày 22/3/2012\r\nHàng hóa gồm Vật liệu xây dựng các loại do Việt Nam sản xuất có hóa đơn kèm theo, có nhãn hàng hóa đúng quy định. Cửa hàng niêm yết giá và bán theo đúng giá niêm yết', 'Chấp hành đúng các nội dung kiểm tra', NULL, '2016-08-11 15:05:53', 30, '2016-08-11 15:05:53', 30, NULL, NULL, 0, NULL, NULL),
(232, '2016-05-11 00:00:00', 'Vũ Minh Kiên', 'Tổ trưởng', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Giấy chứng nhận đủ điều kiện kinh doanh;\r\n- Chứng chỉ hành nghề;\r\n- Hàng hóa đang kinh doanh và hóa đơn chứng từ kèm theo;\r\n- Nhãn hàng hóa;\r\n- Niêm yết giá.\r\n', '08 giờ 10 đến 10 giờ 40', '+ Giấy chứng nhận đăng ký kinh doanh hộ kinh doanh số 35F8000865 do Phòng Tài chính Kế hoạch huyện Vĩnh Thạnh cấp ngày 19/8/2014.\r\n+ Chứng chỉ hành nghề dược số 672/ĐNAI-CCHND do Sở Y tế Bình Định cấp ngày 07/5/2014.\r\n+ Giấy chứng nhận đủ điều kiện kinh doanh thuốc số 269/BĐ-ĐKKD do Sở Y tế Bình Định cấp ngày 15/12/2014. \r\n	+ Hàng hóa đang kinh doanh gồm: Dược phẩm các loại do Việt Nam sản xuất có hóa đơn kèm theo số 0012190 ngày 08/4/2016, số 0012189 ngày 08/4/2016, số 0010181 ngày 22/4/2016, số 0010180 ngày 22/4/2016, số 0017654 ngày 07/5/2016, số 0010337 ngày 09/5/2016.\r\n+ Nhãn hàng hóa: Các mặt hàng trên có nhãn hàng hóa ghi đúng theo quy định của pháp luật về nhãn hàng hóa.\r\n+ Cửa hàng thực hiện niêm yết giá trên từng sản phẩm đúng theo quy định.\r\n', 'Quầy thuốc Chi Lê chấp hành đúng các quy định của pháp luật theo các nội dung kiểm tra.', NULL, '2016-08-11 15:08:13', 30, '2016-08-11 15:08:13', 30, NULL, NULL, 0, NULL, NULL),
(233, '2016-05-12 00:00:00', 'Nguyễn Văn Tú', 'Tổ trưởng', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Hàng hóa đang kinh doanh và hóa đơn kèm theo;\r\n- Nhãn hàng hóa;\r\n- Niêm yết giá và bán theo giá niêm yết.\r\n', '08 giờ 10 đến 10 giờ 25', 'Giấy chứng nhận ĐKKD số 35F800576 do UBND huyện Vĩnh Thạnh cấp ngày 31/7/2008\r\nHàng hóa đang kinh doanh: Ti vi, tủ lạnh các loại do Việt Nam sản xuất có hóa đơn kèm theo, nhãn hàng hóa ghi đúng quy định.\r\nCửa hàng không niêm yết giá hàng hóa (lần đầu)', 'Phạt Cảnh cao', NULL, '2016-08-11 15:11:15', 30, '2016-08-11 15:11:15', 30, NULL, NULL, 0, NULL, NULL);
