(237, '2016-06-08 00:00:00', 'Vũ Minh Kiên', 'Tổ trưởng', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Giấy phép kinh doanh bán lẻ thuốc lá;\r\n- Hàng hóa đang kinh doanh và hóa đơn kèm theo;\r\n- Nhãn hàng hóa;\r\n- Niêm yết giá và bán theo giá niêm yết.\r\n\r\n', '08 giờ 05 đến 10 giờ 40', '+ Giấy chứng nhận đăng hộ kinh doanh số 35F8000696 do Phòng Tài chính -Kế hoạch huyện Vĩnh Thạnh cấp ngày 27/12/2010.\r\n+ Giấy phép bán lẻ sản phẩm thuốc lá số 04/GP-KTHT do Phòng Kinh tế-Hạ tầng huyện Vĩnh Thạnh cấp ngày 03/3/2016 có giá trị đến ngày 03/3/2021.\r\n	+ Hàng hóa đang kinh doanh gồm: Thuốc lá điếu hiệu White House,War nâu, Era đỏ, Era xanh, Saigon; bia, nước giải khát, mì ăn liền, sữa các loại do Việt Nam sản xuất có hóa đơn GTGT số 0013236 ngày 02/6/2016, số 0008323 ngày 31/12/2015, số 0019665 ngày 04/6/2016..\r\n+ Các mặt hàng trên có nhãn hàng hóa ghi đúng theo quy định của pháp luật về nhãn hàng hóa.\r\n+ Cửa hàng thực hiện niêm yết giá bán và bán theo giá đã niêm yết.\r\n', 'Cửa hàng tạp hóa Minh Chung đã chấp hành đúng quy định của pháp luật theo các nội dung kiểm tra.', NULL, '2016-08-11 15:17:21', 30, '2016-08-11 15:17:21', 30, NULL, NULL, 0, NULL, NULL),
(238, '2016-06-15 00:00:00', 'Nguyễn Văn Tú', 'Tổ trưởng', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Hàng hóa đang kinh doanh và hóa đơn kèm theo;\r\n- Nhãn hàng hóa;\r\n- Niêm yết giá và bán theo giá niêm yết.\r\n', '14 giờ 00 đến 16 giờ 30', 'Giấy chứng nhận ĐKKD số 35F8000262 do UBND huyện Vĩnh Thạnh cấp ngày 16/6/2010\r\nHàng hóa đang kinh doanh gồm: Sữa đặc có đường, dầu ăn, bột ngọt, tả lót, nước rửa chén hàng hóa do Việt Nam sản xuất có nhãn hàng hóa ghi đúng quy định. Cửa hàng thực hiện niêm yết giá và bán theo đúng giá đã niêm yết', 'cửa hàng Diệu Hoa chấp hành đúng các quy định pháp luật theo các nội dung kiểm tra.', NULL, '2016-08-11 15:20:37', 30, '2016-08-11 15:20:37', 30, NULL, NULL, 0, NULL, NULL),
(239, '2016-06-23 00:00:00', 'Vũ Minh Kiên', 'Tổ trưởng', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Hàng hóa đang kinh doanh và hóa đơn kèm theo;\r\n- Nhãn hàng hóa;\r\n- Niêm yết giá và bán theo giá niêm yết.\r\n', '08 giờ 00 đến 10 giờ 40', '+ Giấy chứng nhận đăng ký kinh doanh hợp tác xã số 3507F00001 do Phòng Tài chính Kế hoạch huyện Vĩnh Thạnh cấp ngày 12/3/2015.\r\n	+ Hàng hóa đang kinh doanh gồm: Phân bón NPK 16-16-8, NPK 20-20-15TE, Đạm xanh, Kali nga, SA, VL07. Hàng hóa có hóa đơn GTGT số 0002788 ngày 21/6/2016, số 0001375 ngày 05/3/2015, số 0003539 ngày 11/6/2015.\r\n+ Nhãn hàng hóa: Các mặt hàng phân bón trên có nhãn hàng hóa ghi đúng theo quy định của pháp luật về nhãn hàng hóa.\r\n+ Hợp tác xã thực hiện niêm yết giá và bán theo đúng giá niêm yết.\r\n', 'Hợp tác xã Nông nghiệp- KD- DV Tổng hợp Định Bình chấp hành đúng các quy định pháp luật theo các nội dung kiểm tra.', NULL, '2016-08-11 15:22:00', 30, '2016-08-11 15:22:00', 30, NULL, NULL, 0, NULL, NULL),
(240, '2016-06-29 00:00:00', 'Vũ Minh Kiên', 'Tổ trưởng', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Hàng hóa đang kinh doanh và hóa đơn kèm theo;\r\n- Nhãn hàng hóa;\r\n- Niêm yết giá và bán theo giá niêm yết.\r\n', '08 giờ 15 đến 10 giờ 20', '+ Giấy chứng nhận đăng ký hộ kinh doanh số 35F8000788 do Phòng Tài chính -Kế hoạch huyện Vĩnh Thạnh cấp ngày 07/12/2012.\r\n	+ Hàng hóa đang kinh doanh gồm: Tủ lạnh Toshiba, panasonic, Aqua; tủ đông Sanaky; máy giặt Toshiba, quạt bàn Senko, quạt treo Senko; nồi cơm điện Sato, hiệp hưng, Nomax, Sunhouse, Sharp; dây điện Vĩnh Thịnh, V-Star, Tiền Phong. Hàng hóa do Việt Nam sản xuất, nhập khẩu có hóa đơn GTGT số 0000231 ngày 11/01/2015, số 0004150 ngày 09/4/2015, số 0004140 ngày 05/4/2015, số 0004135 ngày 03/4/2015, số 0032137 ngày 03/3/2015.\r\n+ Các mặt hàng trên có nhãn hàng hóa, nhãn phụ, nhãn năng lượng ghi đúng theo quy định của pháp luật về nhãn hàng hóa.\r\n+ Cửa hàng thực hiện niêm yết giá bán và bán theo giá đã niêm yết.\r\n', 'Cửa hàng Bảy Phòng đã chấp hành đúng quy định của pháp luật theo các nội dung kiểm tra.', NULL, '2016-08-11 15:23:13', 30, '2016-08-11 15:23:13', 30, NULL, NULL, 0, NULL, NULL),
(241, '2016-07-06 00:00:00', 'Vũ Minh Kiên', 'Tổ trưởng', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Giấy phép bán lẻ thuốc lá;\r\n- Hàng hóa đang kinh doanh và hóa đơn kèm theo;\r\n- Nhãn hàng hóa;\r\n- Niêm yết giá và bán theo giá niêm yết.\r\n', '14 giờ 00 đến 16 giờ 40', '+ Giấy chứng nhận đăng ký hộ kinh doanh số 35F8000684 do Phòng Tài chính -Kế hoạch huyện Vĩnh Thạnh cấp ngày 03/4/2014.\r\n+ Giấy phép bán lẻ sản phẩm thuốc lá số 01/GP-KTHT do Phòng Kinh tế-Hạ tầng huyện Vĩnh Thạnh cấp ngày 15/4/2014 có giá trị đến ngày 15/4/2019.\r\n	+ Hàng hóa đang kinh doanh gồm: Bia saigon, bia Tiger, mì ăn liền, nước giải khát, nước rửa chén, thuốc lá điếu White house, War nâu, Baston, Era. Hàng hóa do Việt Nam sản xuất.\r\n+ Các mặt hàng trên có nhãn hàng hóa ghi đúng theo quy định của pháp luật về nhãn hàng hóa.\r\n+ Cửa hàng thực hiện niêm yết giá bán và bán theo giá đã niêm yết.\r\n', 'Cửa hàng tạp hóa Vân Hiếu đã chấp hành đúng quy định của pháp luật theo các nội dung kiểm tra.', NULL, '2016-08-11 15:24:59', 30, '2016-08-11 15:24:59', 30, NULL, NULL, 0, NULL, NULL),
(242, '2016-07-12 00:00:00', 'Vũ Minh Kiên', 'Tổ trưởng', '- Giấy chứng nhận đăng ký kinh doanh; \r\n- Giấy phép kinh doanh bán lẻ thuốc lá;\r\n- Hàng hóa đang kinh doanh và hóa đơn kèm theo;\r\n- Nhãn hàng hóa;	\r\n- Niêm yết giá và bán theo giá niêm yết.\r\n', '08 giờ 20 đến 10 giờ 50', '+ Giấy chứng nhận đăng ký kinh doanh hộ kinh doanh số 35F8000273 do Phòng Tài chính -Kế hoạch huyện Vĩnh Thạnh cấp ngày 25/12/2014.\r\n+ Giấy phép kinh doanh bán lẻ thuốc lá số 02/GP-KTHT do Phòng Kinh tế Hạ tầng huyện Vĩnh Thạnh cấp ngày 24/10/2013 có giá trị đến hết ngày 24/10/2018, số 04/GP-KTHT ngày 13/10/2014 (cấp sửa đổi, bổ sung lần thứ nhất).  \r\n	+ Hàng hóa đang kinh doanh gồm: Mì ăn liền, dầu ăn, dầu gội, nước giải khát, nước rửa chén, nước lau sàn nhà, thuốc lá điếu. Hàng hóa do Việt Nam sản xuất.\r\n+ Hàng hóa có nhãn hàng hóa ghi đúng theo quy định của pháp luật về nhãn hàng hóa.\r\n+ Cửa hàng thực hiện niêm yết giá và bán theo đúng giá đã niêm yết.\r\n', 'Cửa hàng tạp hóa Tám Đen chấp hành đúng quy định của pháp luật theo các nội dung đã kiểm tra.', NULL, '2016-08-11 15:26:03', 30, '2016-08-11 15:26:03', 30, NULL, NULL, 0, NULL, NULL),
(243, '2016-09-27 00:00:00', 'Lê Quang Liên, Đặng Thị Lệ Vân', 'Trưởng Đoàn, P Đội trưởng', 'Kinh doanh mặt hàng cấm là thuốc lá nhập lậu.', '10h30\' - 10h50\'', 'Cửa hàng đang kinh doanh hàng cấm là thuốc lá điếu nhập lậu, số lượng 30 bao.', 'Tịch thu tang vật 30 bao thuốc lá nhập lậu, phạt VPHC 3.500.000 đồng', NULL, '2016-09-30 10:02:05', 27, '2016-09-30 10:02:05', 27, NULL, NULL, 0, NULL, NULL);
